INSERT INTO `mdl_local_teaching_survey` VALUES (14358,1596081600,'Building 21 - Philadelphia, PA','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,5,5,'','',3,'','',18,24,16,11,NULL,''),(14359,1596081600,'Pointe Coupee Parish, LA','School-based coach',5,5,5,5,5,5,'The course helped me to focus on what instruction is important for the upcoming year.  Thank you!','3',3,5,5,0,0,'All of it was incredible.  ','Nothing',3,'I love how Teaching Lab uses research, procedures, and routines to teach curricula.  It is learning about the curricula through applicable strategies.  ','Thank you again!  I appreciate the thoughtful and intentional training.  The training and discussions helped me be reflective and plan for the upcoming school year.  ',18,25,0,11,NULL,'Modeling the ideas, discussion, and practicing the ideas.'),(14360,1590984000,'Calcasieu Parish, LA','Teacher or specialist',5,5,3,3,5,5,'by breaking down and selectively looking at the needs of students and how to deliver intentionally and support students through a combination of learning styles (hybrid etc.)','3',3,5,5,0,0,'the addressing of topics that needed to be looked at closely for optimal learning experience','nothing at this time',3,'this rating adequately describes the experience of this professional learning based on its objective and completion of its objective.','none at this time',6,32,0,12,NULL,'breakout rooms, on screen examples, charts'),(14361,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,4,5,5,5,3,'Specific planning was discussed in group breakout sessions','3',3,5,5,0,0,'Meeting in chat room with other teachers to share','More specific information about technology and how detailed our lessons should be',3,'Jalinda did a great job','',6,32,0,12,NULL,'Same'),(14362,1591156800,'Calcasieu Parish, LA','Teacher or specialist',4,4,5,5,5,4,'Organizing my thoughts/ideas','3',3,4,4,0,0,'Getting to talk through ideas with my peers.','Having more time.',3,'I liked the breakout rooms.','',6,32,0,12,NULL,'Getting to talk through ideas with my peers.'),(14363,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,4,4,'virtual learning','3',3,4,4,0,0,'talking to my teammates','more modeling',3,'it may be too advanced for some','no',6,32,0,12,NULL,'breakout sessions'),(14364,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'It has helped me with knowing what to teach to the students in person (online/classroom) and what they can do on their own.','3',3,5,5,5,5,'Really, it was helpful to sit and discuss and make a game plan, per say, for next year based on the information presented to us.','nothing',3,'Because this has been extremely helpful to just process what I need to do for next year.','',6,32,29,12,NULL,'group discussions'),(14365,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Better understanding of unpacking lessons for online instruction','3',3,5,5,0,0,'Organized and Well planned','Nothing. It was great!',3,'It was an informative meeting.','',6,32,0,12,NULL,'Collaboration with other grade level teachers'),(14366,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,4,5,5,5,3,'Specific planning was discussed in group breakout sessions','3',3,5,5,0,0,'Meeting in chat room with other teachers to share','More specific information about technology and how detailed our lessons should be',3,'Jalinda did a great job','',6,32,0,12,NULL,'Same'),(14367,1591156800,'Calcasieu Parish, LA','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'The Guidebooks Unit Unpacking course helped me get very clear on what I need to be very intentional about when making decisions around what aspects of the unit and lessons are high-leverage. Making sure to support students in both synchronous and asynchronous learning will demand that teachers have a clear understanding of the skills and knowledge taught throughout the unit. This training helped solidify this for me and has triggered my understanding of planning to better address students\' needs.','3',3,5,5,0,0,'The time to engage in the unpacking as well as the collaboration with peers was much needed.','Everything was great.',3,'The training was very focused and aligned to our needs in the present time.','',6,32,0,12,NULL,'Break-out sessions required all to do the exercises and think about how they will apply to their future unit preparation.'),(14368,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Understanding synchronous and asynchronous learning.','3',3,5,5,0,0,'Breakout sessions','Preparing to deliver lessons online.',3,'I believe this is the way of the future regardless of the pandemic.','I really like hearing from other teachers and their concerns. It let\'s me know I\'m not in this alone.',6,32,0,12,NULL,'Unpacking targets'),(14369,1591156800,'Calcasieu Parish, LA','Teacher or specialist',4,4,5,5,5,4,'Organizing my thoughts/ideas','3',3,4,4,0,0,'Getting to talk through ideas with my peers.','Having more time.',3,'I liked the breakout rooms.','',6,32,0,12,NULL,'Getting to talk through ideas with my peers.'),(14370,1591156800,'Calcasieu Parish, LA','District/network-based coach or Curriculum and instruction specialist',5,5,4,4,5,5,'Helped me start thinking about how to plan for distance learning.','3',3,5,5,0,0,'Time to collaborate and think','N/A',3,'I think it is an imperative part of planning that is often overlooked and not done','Dr. Soto Rocks! Can you invent virtual coffee?',6,32,0,12,NULL,'Digging into our unit'),(14371,1591156800,'Calcasieu Parish, LA','School-based coach',5,5,5,5,5,4,'recognizing synchronous vs. asynchronous','3',3,5,5,0,0,'The collaboration in breakout groups','N/A',3,'preparation for new school year','N/A',6,32,0,12,NULL,'all'),(14372,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'It has helped me focus on what/how to deliver content in a non-traditional manner','3',3,5,5,0,0,'The delivery was excellent and concise. I also loved the collaboration with my team members.','Everything was spot on. I can\'t think of a thing that needed improvement.',3,'There was time allotted for collaboration and discussion. These discussions were meaningful.','I appreciate this training as it helped me clarify items I was questioning.',6,32,0,12,NULL,'Break out sessions were extremely beneficial'),(14373,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,4,'Unpacking with other teachers extremely beneficial!','3',3,5,5,0,0,'Breakout rooms were AMAZING! Great discussion!','Can\'t think of anything.',3,'Very beneficial for planning for our new normal...whatever that is.','Thanks so much!',6,32,0,12,NULL,'Collaborating with other 8th grade teachers.'),(14374,1591156800,'Calcasieu Parish, LA','Teacher or specialist',4,4,5,5,5,3,'It helped provide some info as to how to prepare and get lessons out to students.','3',3,5,5,0,0,'Breakouts','N/A',3,'Today was helpful.','',6,32,0,12,NULL,'Breakouts'),(14375,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,3,'Understanding the difference in synchronous and asynchronous','3',3,5,5,0,0,'Technology','Unsure',3,'Well planned and structured. Easy to follow along','',6,32,0,12,NULL,'Break out groups'),(14376,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Focusing on what is important for in class learning vs. independent learning!','3',3,5,5,0,0,'The breakout sessions produced an amazing time of collaboration among peers.','n/a',3,'I loved the conversation and collaboration that it created.','',6,32,0,12,NULL,'Breakout sessions'),(14377,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,3,5,5,5,3,'The last breakout group was the most beneficial in trying to plan for virtual element of school opening.','3',3,5,5,0,0,'Breakout groups','More focus on what to do in virtual setting',3,'It was helpful but wanted more focus on implementing GB on virtual level','',6,32,0,12,NULL,'Breakout groups'),(14378,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'It’s helped me in my planning of online lessons','3',3,5,5,0,0,'Collaboration','Less distractions at home lol',3,'Effective delivery','None',6,32,0,12,NULL,'Synchronous or asynchronous topic'),(14379,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,4,4,5,5,'It helped me to begin the proccess of understanding WHAT lessons should be async/sync.','3',3,5,5,0,0,'Loved the breakout sessions.','More time -  obviously.',3,'Really enjoyed the session.','',6,32,0,12,NULL,'Looking through the sections with team members.'),(14380,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'It helped me better prepare for what\'s considered synchronous and asynchronous material','3',3,5,5,0,0,'Overall knowledge of the material','Keep us in break out sessions longer',3,'I loved everything about it','',6,32,0,12,NULL,'Break out sessions'),(14381,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'To better decipher which standards are high leverage','3',3,5,5,0,0,'Collaboration','Overall it was great',3,'Very professional and helpful.','',6,32,0,12,NULL,'Asynchronous v. Synchronous worksheet'),(14382,1591156800,'Calcasieu Parish, LA','Teacher or specialist',4,5,5,5,5,4,'By collaborating with colleagues to discuss ways in which to prepare.','3',3,5,5,0,0,'The collaboration among colleagues','answered questions',3,'It would depend on the needs of the colleague','',6,32,0,12,NULL,'breakout sessions'),(14383,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'All was great','3',3,5,5,0,0,'Organization and technology','All went well',3,'Smooth','',6,32,0,12,NULL,'Collaboration'),(14384,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,4,'Collaborating with other teachers and the instructor to discuss what lessons could be taught asynchronously versus synchronously.','3',3,5,5,0,0,'The breakout groups and collaboration with other teachers.','Nothing',3,'The presentations are helpful in guiding how Guidebooks should be taught and why the lessons are sequenced the way that they are.','Thank you!',6,32,0,12,NULL,'Discussions'),(14385,1591156800,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Ideas for unpacking the unit','3',3,5,5,5,5,'Discussions and breakout groups','Nothing at this time',3,'Well prepared presenters and quality information','No',6,32,29,12,NULL,'All of them'),(14386,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',5,5,5,5,5,5,'It was something new with many areas that will help my students when we do return.','3',3,5,5,5,5,'They opened my eyes to some strategies I\'ve thought about.','If it were in person and not virtual',3,'I feel that I learned so much that will help me to become a better educator.','',8,9,20,13,NULL,'collaboration, teaching with integrity, using the 4T\'s and RTTW'),(14387,1591243200,'Louisville School District - Jacob Elementary, KY','librarian',5,3,5,4,3,3,'Hopefully to provide a focus for the curriculum.','3',3,5,5,5,4,'I think it all went well, just a lot of information!','Slow it down a bit! Lots of great information -  but not enough time to process through it all!',3,'Too Fast/Too Much information','',8,9,20,13,NULL,'Doing the work in groups'),(14388,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,5,5,3,4,'more in depth understanding of the why behind the curriculum','3',3,4,4,4,4,'zoom calls','the moodle was hard to use for me.',3,'moodle was hard to navigate','',8,6,3,13,NULL,'zoom calls'),(14389,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',3,4,4,4,5,4,'It has given me clarity on the curriculum.','3',3,5,4,4,4,'It went well considering the circumstances. Meetings were well organized and flowed.','Face to face - which could not have been an option',3,'I liked the break out groups but was not put in the group with the 6th teacher I will be working with. I was put into random groups that didn\'t make sense.','',8,6,3,13,NULL,'Working in the break out groups/ independent reading'),(14390,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',2,3,5,5,4,1,'I don\'t think this course was designed to help with school after covid.','3',3,4,5,2,4,'As much work as the modules seemed like in the beginning, I learned a lot about the \"why\" of the EL curriculum. There are so many facets to this complex curriculum but the rewards will be great.','Better technology knowledge with the chrome book.',3,'I was hoping to have more knowledge of actually what to do to prepare a day to day lesson. After unpacking the assessment, where do you start? There are 3 resources and some of the lessons are dozens of pages with a lot of preparation materials, check lists for students and teacher etc. After learning the why I needed more modeling of how.','No',8,6,3,13,NULL,'Reading and re-reading, taking notes on everything...I was starting from square one.'),(14391,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,5,5,5,5,1,'Not sure','3',3,5,5,5,5,'Getting help when it was needed','Finding material on Moodle',3,'Because it gives a better understanding and background of the curriculum.','',8,6,3,13,NULL,'The breakout groups'),(14392,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,4,5,5,4,'It demonstrated different methods, protocols and strategies.','3',3,3,5,5,5,'The team work, camaraderie of the teachers and participants, and support from the EL staff.','Nothing',3,'I chose this rating because of the support that Justin and Tara provided for the participants. Thank you to both of you.','no',8,6,3,13,NULL,'There was a great deal of knowledge about the curriculum and the supports that it supplies for lower ability students.'),(14393,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,5,5,5,5,5,'I learned more about the virtual tools and technology a little bit to possibly work with students.','3',3,5,5,5,5,'The amount of guidance and support for learning this curriculum.','I was nervous at times because I was not always clear on how to be on a zoom call and have a document pulled up on my scree. I felt better when the facilitators shared their screen.',3,'These are real educators that work with this curriculum in the classroom. If teachers are to be trained to teach a curriculum it definetely should come from real teachers who have been in the classroom in recent years.','Appreciate these two facilitators.',8,6,3,13,NULL,'Break out sessions where we shared and listened to each other\'s ideas.'),(14394,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,5,'more understanding','3',3,5,5,5,5,'communication','na',3,'well done and knowledgeable','na',8,6,3,13,NULL,'supports and scaffolds'),(14395,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,4,5,5,5,'Virtual classroom practice...','3',3,5,5,5,5,'As complex as this curriculum is, I\'m so appreciative that we broke things up.','Better internet and computer...',3,'Because this course was very helpful.','Thank you for taking the time to help us with this curriculum. There are so many benefits to it. This course can help us maximize the impact of learning with the least amount of struggle. It\'s working smarter and not harder.',8,6,3,13,NULL,'All of it.'),(14396,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,3,'I feel more confident with what I am dealing with. I would like to see it actually taught in the middle school level.','3',3,4,4,4,4,'The entire school was able to dive in and really try accept this training- even with the bad taste a lot of people have of EL.','I wish I could see this taught in the middle school level.',3,'If I could see it actually be taught, I would be sold even more. I wish I knew teachers who have the students read for homework and how they were able to get their students to accomplish this- or what happens to those who do not read. I have a hard time when students don\'t read and this is heavily about reading.','',8,6,3,13,NULL,'the three squares of the assessments. I hope my school has us do this in our own PLC\'s'),(14397,1591243200,'Fort Dodge Schools, IA','District/network/state-level professional or administrator',4,5,5,5,4,5,'Feel better prepared to support teachers in implementation','3',3,5,5,5,5,'Like both the synchronous and asynchronous learning opportunities','Nothing -  I just need to spend more independent time reviewing and familiarizing myself with the materials and texts',3,'It is extremely beneficial and well planned','',8,6,3,13,NULL,'Loved the shifts activities so much and the opportunity to dig in to the materials'),(14398,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,3,'Begin with a vision and understand the foundation of the EL curriculum.','3',3,4,4,4,4,'conversations with colleagues, learning about the foundations of the EL curriculum.','More time',3,'It was a great deal of work and just think more time would have been beneficial.','',8,3,6,13,NULL,'The independent work and collaboration with colleagues.'),(14399,1591243200,'Fort Dodge Schools, IA','District/network/state-level professional or administrator',4,3,5,5,3,2,'We didn\'t discuss this topic.','3',3,3,3,3,3,'Communication of content.','It was hard to follow which materials we needed during Zoom meetings. Some of the Moodle activities were difficult to understand/ navigate.',3,'The content is very helpful in giving an overall view of the curriclum.','',8,6,3,13,NULL,'Working through the modules.'),(14400,1591243200,'Fort Dodge Schools, IA','School-based coach',5,5,5,5,4,3,'It helped me understand EL in general, especially the design of the curriculum. This format also gave me ideas on how to teach virtually,','3',3,5,5,5,5,'The asynchronous work was the perfect amount to help me learn without being overwhelming.','N/A',3,'I learned an unbelievable amount in a short amount of time.','',8,6,3,13,NULL,'I enjoyed the breakout rooms to hear from my colleagues.'),(14401,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,4,'It has provided me an oppotunity to see the curriculum through a virtual route so I know what it looks like if we have to do this again.','3',3,5,5,5,5,'The engagement throughout the Zoom meetings and the Moodle page.','N/A',3,'I thought it was very engaging and informative, while learning from other colleagues at different grade levels.','This was a great experience and I feel more confident with this curriculum! Thank y\'all so much!',8,6,3,13,NULL,'The activities where we broke out into break out groups because it felt like we were viewing things from a student perspective.'),(14402,1591243200,'Fort Dodge Schools, IA','School-based coach',5,5,5,5,5,5,'I have a better understanding of how to access the supports and where. I have a better understanding of how everything is connected to the performance task, along with the importance of backwards planning. I learned more about the implementation of the RTTW and will be better prepared to teach when I return to school.','3',3,5,5,5,5,'It was helpful to have the assignments and articles to read before zooming, so we were able to process the information and contribute more to the group discussions.','Next time -  having smaller grade level groups to dig deeper into the modules.',3,'We can use this time to better plan','Great work and I appreciate how thorough you both were!',8,6,3,13,NULL,'The zooms and group talks (breakout rooms). The parking lot was helpful, too.'),(14403,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,3,3,3,2,'There wasn\'t a particular focus on how to re-orient students to the classroom following Covid-19.','3',3,4,4,2,3,'Learning how to navigate curriculum materials','More small activities to complete independently',3,'Because it\'s a great guide for first-year teachers!','',8,6,3,13,NULL,'Shifts elevator pitch'),(14404,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,5,4,4,'Just knowing more about the curriculum','3',3,4,4,4,4,'Our discussions','Being in person',3,'It was good, I\'m just not great with technology','',8,6,3,13,NULL,'Our discussions'),(14405,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,4,'I would love to have these trainings in person before a school year starts and not at the end.','3',3,5,5,5,5,'The collaboration with other teachers and getting on the same page as a school.','In person learning',3,'It was helpful but some may find it to be a lot of work.','',8,6,3,13,NULL,'Breakout groups'),(14406,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,3,3,4,4,'I better understand to help meet the needs of my students.','3',3,4,4,5,4,'Communicating with other professionals about what questions we have or what our thoughts are.','If there were more activites toward special education teachers.',3,'Information was clear and I was able to communicate with other coworkers to discuss our thoughts.','',8,3,6,13,NULL,'The meeting the needs of all learners activity.'),(14407,1591243200,'Fort Dodge Schools, IA','School-based coach',5,5,5,5,5,4,'Spending time diving into the scaffold and supports built into the curriculum and offered in each lesson will help us meet the needs of ALL our students when we are back on-site learning together.','3',3,5,5,5,5,'Asynchronous work set the foundation for diving deeper and making connections in our zoom calls.','More face-to-face time',3,'Engaging, content rich, community environment of learners, skilled facilitators.','',8,3,6,13,NULL,'Module unpacking and lesson unpacking for scaffolds'),(14408,1591243200,'Fort Dodge Schools, IA','School-based administrator or supervisor',5,5,5,5,5,5,'Hit the ground running when we get back','3',3,5,5,5,5,'Facilitators did a great job with the Zoom','More hands on things that we would\'ve been able to do had we met face to face -  or had students to try things with',3,'Valuable training','',8,6,3,13,NULL,'Listening to the experts break things down'),(14409,1591243200,'Brownington Central School, VT','Teacher or specialist',3,4,4,4,1,2,'I don\'t know how we can build collaboration and community with students virtually. Very difficult without body language.','3',3,4,2,0,0,'It was a basic overview.','I am from VT and would have liked to have more discussion/processing time with my colleagues. Buy-in is key and I know that not everyone does.',3,'I am brand new to EL and it seemed like I was supposed to already have experience with it. I found the Zoom/Moodle experience to be scattered and non-sequential. There were quite a few times that I felt like I had missed something---an assignment or other. When I went back to review the assignments, I had not missed anything. I needed less time with you trying to convince me the importance of PD and more time on the actual unpacking of the curriculum. You called it \"unpacking\" but it never felt that way. Another issue was when we were broken into chat rooms. An example was the other day (I don\'t remember the assignment), but we were supposed to spend 10 minutes on the first topic, 10 minutes on the 2nd topic and 2 minutes on the final summation. I had written this down when we were given the verbal instructions. The chat room time was only given around 10 minutes for the whole thing. Frustrating. I could have gotten the same knowledge by reading the teacher\'s manual and unpacking on my own first. Then I would have loved to have your expertise to help me understand more fully and answer my questions.\n \n The other issue for me is that many of the videos you had us watch were from charter schools and independent schools rather than public schools. Students behave far differently when they are in uniform or in an all girl\'s school.','You are clearly very knowledgeable and a believer in this curriculum. I appreciated your exuberance.',8,9,0,13,NULL,'Reading and reflecting'),(14410,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,3,4,4,3,4,'This course helped to understand the foundational components of EL Education. Next step will be to get actual materials in hand and begin collaborating and planning.','3',3,4,4,0,0,'Breakout rooms seemed to be effective with such a large group.','Spending more time on the actual materials and having hard copies of them would have helped me a lot.',3,'It was very informative and could be done from your home.','',8,9,0,13,NULL,'Diving in and looking at the materials supported my learning.'),(14411,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',3,4,3,4,4,1,'I do not feel prepared to implement this if we do not go back to school in a traditional way','3',3,4,4,4,4,'I was able to learn and collaborate in a virtual setting','To have the physical materials in hand',3,'I would have to implement it first','no',8,9,20,13,NULL,'Diving into lessons and watching videos of other teachers classrooms'),(14412,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,4,4,4,4,3,'This was an introduction to our new reading program . It offered a look into what we will be doing. But I am really looking forward to having the materials in front of me.','3',3,4,4,0,0,'I enjoyed the breakout rooms and being able to discuss things in a small group.','Being able to meet in person -  but since that was not possible -  this was the next best option. Also -  it was occurring while I was still teaching NTI - so it was difficult fitting all the zoom meetings and the course work in while still trying to keep up with my classroom requirements. So my only other suggestion would be to have the Bootcamp at a different time.',3,'I like what I learned about your program and feel like it will be beneficial to my students.','no',8,9,0,13,NULL,'When working in a small group and discussing a topic.'),(14413,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',3,3,3,3,4,3,'I feel uncertain about how we will do this if we don\'t go back in the fall.','3',3,3,3,3,4,'No problems with virtual learning, just the platform was difficult to navigate the first few lessons.','Direct links to the materials we need for the Modules instead of making us search for them. Without the actual books to \"touch\" it was unnecessarily/VERY time consuming to find the right resources on the platform',3,'It was too time consuming. I had alot of work to wrap up since May 18th and I felt overwhelmed having to take this on, as well.','',8,9,20,13,NULL,'Working in small break outs was best for me, especially when looking for the materials on the platform.'),(14414,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',5,5,5,5,3,5,'This course has taught me how to implement the EL curriculum. It has given me a headstart on the school year.the EL curriculum the EL curriculum.','3',3,5,5,5,5,'I think the fact that we had to do all of the assignments out of class and then reviewed them in class.','If we had been in person with books and not virtual.',3,'I would\'ve given it a 10 if it hadn\'t been virtual.','I put someone other than Kristen Briggs because her name was not on the list.',8,9,20,13,NULL,'The assignments'),(14415,1591243200,'Brownington Central School, VT','Teacher or specialist',5,5,5,5,5,2,'That was actually the question that I was just thinking about. How to have the collaboration if we have to have remote learning. I think have break out rooms could work. That adds another layer of complexity in my brain right now! We will make it work because we alwys do!','3',3,5,5,5,5,'I actually liked using the moodle learning lab. I enjoyed how it was set up and easy to use. I enjoyed the variety of tools that the facilitators used even through only an online learning platform.','Having some more school time to figure it out for us!',3,'I just enjoyed the set up, conversations, learning and excitement from this training!','Thank You!',8,9,20,13,NULL,'Breakout rooms were great!!!!!'),(14416,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',5,5,5,5,5,5,'I am more familiar with the curriculum we will begin using.','3',3,5,5,5,5,'I thought the homework was very helpful in helping us become familiar with the resources.','In-person learning',3,'It was very thorough in acquainting us with the curriculum, but also the understanding and research behind its use.','',8,9,20,13,NULL,'I liked the breakout rooms where we got to share thoughts with other teachers.'),(14417,1591243200,'Brownington Central School, VT','Teacher or specialist',4,4,4,4,4,4,'understanding of how to use the program with my special education students','3',3,4,4,0,0,'Having the material to look at as we explored','being in person for sure',3,'I believe the information is important the program will benefit students','',8,9,0,13,NULL,'hands on'),(14418,1591243200,'Louisville School District - Jacob Elementary, KY','School-based administrator or supervisor',5,5,4,4,5,4,'It has prepared me for how to assist and coach my teachers in EL Education.','3',3,5,5,5,5,'The Moodle allowed us to read and engage in the learning.','To have the books in front of me',3,'It was a great experience','No',8,9,20,13,NULL,'Moodle'),(14419,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,5,4,4,3,3,'I know what I need to be implementing when schools open back up after COVID-19','3',3,4,4,0,0,'Diving in the modules to learn how and what we will be implementing.','I would like to have had more discussion about the character building aspect of this curriculum',3,'I chose this rating because overall the EL presentation was successful even virtually','None at this time',8,9,0,13,NULL,'The reflections and discussions among peers'),(14420,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',3,3,4,3,4,3,'I am now familiar with the teacher\'s guide, supplemental materials, and video library for EL Education through openupresources.org.','3',3,4,4,0,0,'Moving through the EL Materials such as the modules and units, as well as discussion of the protocols and support. Mandi always quickly replied to emails. She and Kristen provided links to supports in chats during training.','More time to work with grade level team on the module and unit planning. A great deal of learning and preparation happens here. Providing an example in the Module Unboxing the way they did in the call for the Unit Unboxing. I think less time should be spent in learning about teaching lab and how they do business and more time should be spent really getting familiar with the materials and viewing more examples of EL in the classroom and having time to debrief about that. I also think less time should be spent going over the non EL materials and responding in chat boxes (like the GIFs and the norms).',3,'I did get a lot out of it, but I believe a could have gotten so much more.','',8,9,0,13,NULL,'The module planning and discussion.'),(14421,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,4,3,3,4,4,'by working together for a common goal','3',3,4,4,4,4,'The Zoom calls and being able to print out handouts','having the materials at hand (books)',3,'I do better in person','no',8,9,20,13,NULL,'videos'),(14422,1591243200,'Brownington Central School, VT','Teacher or specialist',4,4,5,4,3,2,'I feel like the course helped me to prepare to implement the program in a classroom, regardless of COVID-19.','3',3,4,3,0,0,'The independent learning requirements really helped to support what we need to know going forward. We have a foundation of knowledge to begin planning our instruction.','Working with members of our school alone -  as the combination made it more challenging to share and tailor what we need to know for our school and students. The team work together would have been more beneficial and a better use of our time -  even if just in break out rooms.',3,'I do not know of any other schools who are considering using EL.','',8,9,0,13,NULL,'The independent work and then the review as a whole group, pointing out the key ideas in our learning.'),(14423,1591243200,'Brownington Central School, VT','Teacher or specialist',4,4,4,4,3,3,'Not knowing what school is going to look like, makes this difficult to answer. I am hoping that no matter what comes in the fall, this knowledge of EL will help me to meet students\' needs.','3',3,4,3,4,3,'Overall, the content flowed pretty well, considering glitches and the whole online experience.','More time to dig deeper into the curriculum',3,'I think it is good for all teachers who are going to be using a curriculum to understand the why and how of its design.','',8,9,20,13,NULL,'Discussion with small groups'),(14424,1591243200,'Louisville School District - Jacob Elementary, KY','School-based coach',4,4,4,3,5,4,'I feel like I have a much better understanding of how to navigate and plan with the modules.','3',3,5,5,0,0,'I learned a lot about EL and feel much more comfortable with the curriculum.','To be able to work with our current grade level teams -  and not be put in rooms with teachers we are not working with. More time actually working within the modules in breakout rooms.',3,'I think the EL curriculum would be difficult to implement if you do not have an understanding of the components and the way it was designed.','',8,9,0,13,NULL,'The module unpacking box template.'),(14425,1591243200,'Brownington Central School, VT','Teacher or specialist',5,5,4,5,5,5,'As long as we return to in person schooling, I feel ready. If we return to online schooling I will struggle with how to implement this curriculum.','3',3,5,4,4,4,'For remote learning, this was done very well.','None',3,'I enjoyed it for being online','',8,9,20,13,NULL,'The breakout rooms were great! It allowed us to work in smaller groups.'),(14426,1591243200,'Brownington Central School, VT','School-based administrator or supervisor',4,4,4,3,2,4,'I will be able to supervise my teachers and help them prepare EL.','3',3,4,2,0,0,'The independent learning went well.','Some of the zoom sessions did not work as planned. Also -  there were times when no one in the group understood the directions for a breakout. As the sessions went on -  this became easier with linked directions.',3,'I have some new teachers that I hope to get this training this summer.','',8,9,0,13,NULL,'Videos, unpacking protocols'),(14427,1591243200,'Louisville School District - Jacob Elementary, KY','School-based administrator or supervisor',4,3,4,4,4,2,'Since we don\'t know what school is going to look like upon re-opening, right now it is difficulty to see how many aspects of this program (especially the collaboration) are going to be able to be used particularly if we return with strict social distancing measures in place or if we have to begin virtually.','3',3,5,5,0,0,'I think the time with the breakout rooms were helpful. It allowed us to work colleagues despite being in a virtual setting.','Having EL materials available in hand rather than digitally.',3,'The training was very helpful in introducing the EL program.','',8,9,0,13,NULL,'The materials, particularly the articles and videos, provided in the modules were very helpful!'),(14428,1591243200,'Brownington Central School, VT','Teacher or specialist',4,4,4,4,4,2,'It introduced the curriculum','3',3,4,4,0,0,'The time spent in groups collaborating with peers from my school.','Working with my school more.',3,'It was really good, and the instructors did a good job.','',8,9,0,13,NULL,'Breakout Sessions.'),(14429,1591243200,'Brownington Central School, VT','Teacher or specialist',3,5,4,4,3,2,'I will now know how to effectively use the EL books and guides.','3',3,5,5,5,5,'Learning the nuts and bolts of the program.','The sight is really glitchy. Lots of technical issues.',3,'I wish I had more time with my colleagues to collaborate.','',8,9,20,13,NULL,'The moodle assignments and the break out rooms.'),(14430,1591243200,'Louisville School District - Jacob Elementary, KY','School-based coach',5,5,5,5,5,5,'Prepare for implementation of what it could possibly look like if virtual in the fall by completing the bootcamp virtually','3',3,5,5,5,5,'Kristen Briggs was the 2nd facilitator. I did not see her name as a choice under the list of options but completed the ratings for her that were relative for the 2nd presenter option.','Having hard copies of the materials (although I know this was a barrier due to COVID-19)',3,'The training fit the needs of our school to build capacity in the area of literacy.','',8,9,20,13,NULL,'The breakout rooms and having time to work with our colleagues.'),(14431,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,5,5,4,4,4,'It gave me resources to look over as we prepare','3',3,4,4,0,0,'The ability to collaborate','Having the materials handy',3,'I feel that this will be extremely beneficial for our students and professional learning','NA',8,9,0,13,NULL,'I really enjoyed the videos so that I could see it being put into practice'),(14432,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,4,5,5,5,5,'The way in which I will teach the first module.','3',3,5,5,5,5,'getting to do backwards planning for module 1','more time diving into modules',3,'I would rather it be in person.','',8,9,20,13,NULL,'breakout rooms'),(14433,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',3,4,4,4,4,3,'Starting fresh with a brand new curriculum that has structure will be beneficial for my students.','3',3,4,4,0,0,'The Zoom calls and break out sessions went really well.','There was a lot of work to do outside the Zoom calls which did not allow much collaboration with your team or other colleagues. I also felt the Moodle activities needed to be explained better.',3,'I would recommend it not be virtual, but we could not help that. Mandi was a great host!','N/A',8,9,0,13,NULL,'Break out sessions'),(14434,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,3,4,5,4,3,'I hope this can help limit all the time I spend on trying to find the right materials.','3',3,5,4,4,4,'The breakout rooms','n/a',3,'Even with computer work, it was very well formatted and I learned a lot.','',8,9,20,13,NULL,'The teaching lab.'),(14435,1591243200,'Louisville School District - Jacob Elementary, KY','Reading Intervention Teacher',3,2,3,3,4,3,'Teacher collaboration.','3',3,3,5,0,0,'Having the opportunity to learn about the why behind EL.','This type of learning was new to everyone -  so I don\'t want to sound too critical. I think that too much time was spent on how the curriculum was developed (which is important -  but not necessarily what teachers new to the curriculum need) and not on actually digging in to the materials that they will be using in the classroom. I often felt that there was a disconnect between the coursework and the online sessions.',3,'See my answer for improvements.','I appreciate the hard work that went in to teaching this online course. Not only is it difficult to manage such a large group physically, Mandi did a great job virtually.',8,9,0,13,NULL,'Some of the learning tasks completed individually.'),(14436,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',3,3,3,4,4,3,'It helped introduce me to a new curriculum.','3',3,4,4,4,4,'What went well was having the ability to collaborate with teachers from another state as well as those on my team in both a Zoom and discussion board setting.','The ability to have more collaborative and hands on activities.',3,'The course was well organized and provided a lot of useful information.','',8,9,20,13,NULL,'The Zoom meeting discussion topics and videos of the curriculum in action best supported my learning.'),(14437,1591243200,'Louisville School District - Jacob Elementary, KY','Interventionist',3,3,2,3,3,3,'It helped to know what my school will be doing in the future so that I am aware of how this will work with interventionist.','3',3,4,3,0,0,'Listening to the Vermont people taking about their experience','Being in person with the materials. It was difficult trying to go back and forth to find materials.',3,'It looks like a good program and I believe that it could help a lot of our students.','',8,9,0,13,NULL,'Once materials were found then it was easy to use.'),(14438,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,2,3,3,3,2,'N/A - I am a resource teacher and do not teach whole group literacy.','3',3,4,4,0,0,'The online work fit well with the work we did on the Zoom calls.','Not having so much work to complete outside of the required Zoom calls.',3,'I think this professional learning would benefit anyone who is adopting the EL curriculum.','N/A',8,9,0,13,NULL,'The Zoom calls.'),(14439,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,3,5,3,'supports','3',3,4,5,4,5,'sharing and community','group wror- we were not divided into who we would be working with',3,'Much more time to do the work and assignments that they said','no',8,6,3,13,NULL,'learning the supports'),(14440,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,5,4,4,4,3,'I now have a better understanding of the EL curriculum, which will help me as we go back to school. I do need to continue to look through all of the resources to figure out where everything is. I struggle with everything being in a google doc/folder.','3',3,3,3,4,4,'Learning the \'why\' of this curriculum.','A couple of the breakout activities didn\'t have enough time to complete. It also was kind of confusing trying to find the resources we were supposed to be looking at...for example -  looking at the un-boxing protocol. It was difficult (for me especially) to find where our lessons/modules were. This may have been a problem on my end as everything is online and in google docs.',3,'I chose this rating because unless my colleague or friend is teaching this curriculum, I am not sure why they would go through this professional learning.','I do wish there was more information available for teaching this curriculum in 6-8th gr block.',8,6,3,13,NULL,'I think I learned the most when we did the activity to help us understand the shifts.'),(14441,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,5,5,4,4,2,'I do not know since know one really knows what our school will look like in the fall.','3',3,5,4,5,4,'I thought this learning really did help me understand the philosophy of the curriculum, how it was set up, and how it was to be taught. I understand all the parts of this curriculum and how to make sense of it all. I feel better prepared to teach with it.','I think taking the teachers through a practice RTTW activity would have been helpful -  so we could see and feel it in action.',3,'If a district is adopting this curriculum, this book camp really does help to see how everything fits together and how to teach with it. I taught a module 3 years ago and we had nothing like this to explain the curriculum. It was extremely difficult to teach with this curriculum. Now I am prepared.','',8,6,3,13,NULL,'The before the shift and after the shift learning also activities that took me into my grade level module.'),(14442,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,3,4,3,4,'How to organize my learning the scaffolding for students','3',3,4,4,3,4,'Hearing answers and thoughts from our colleagues','I was always behind a step or two . The reason is when we first started I thought we were to do our learning when we went to virtual meetings and I was not correct in that thought because we were to do the preview homework before the next meeting. I eventually got caught up but late. I know if I did the homework before the meeting I would have more of a success in learning the EL curriculum. I am not sure if you should make it more of a point to do the homework before the next meeting or I might have understood wrongly. I process a little slower than most which could have been my fault.',3,'If I was on board with all of the meetings ,I believe I would recommend the professional learning because even though I was behind I could understand as they talked.','',8,6,3,13,NULL,'the preview of learning coming up'),(14443,1591243200,'Fort Dodge Schools, IA','School-based administrator or supervisor',4,3,4,4,4,4,'gave us more chance for virtual collaboration.','3',3,4,4,4,4,'I felt the collaboration and breakouts were well received and helpful.','Some of the assignments could have been geared toward administration.',3,'If I come across a fellow administrator who is planning on using the OER modules I will recommend it but it would work better face to face.','no',8,6,3,13,NULL,'I liked the discussion posts and replies.'),(14444,1591243200,'Fort Dodge Schools, IA','School-based administrator or supervisor',4,4,4,4,5,4,'Collaboration along with virtual learning.','3',3,5,5,5,5,'Ability to discuss things as a group.','NA',3,'Quality training','',8,6,3,13,NULL,'Time for collaboration'),(14445,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,4,5,5,4,'How materials can be transferred virtually.','3',3,5,5,5,5,'The Zoom meetings went so well! I loved practicing what we learned and I thought the facilitators did a great job considering the circumstances.','Some mishaps with Moodle but out of all the times I\'ve used Moodle as a learning platform -  this was the most smooth transition of material I\'ve ever experienced!',3,'This was just overall very helpful and I learned a lot.','Thank you!! :)',8,6,3,13,NULL,'Zoom meetings'),(14446,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',3,5,3,3,5,2,'Another component to online learning, using a different platform and becoming more comfortable with Zoom.','3',3,4,4,5,5,'I think them talking about the different components of the new curriculum. I felt like they handled the virtual component well. Everything was easy to understand and follow.','I would say almost every time we went into a break out room that was supposed to be grade specific -  I was never with the people I would be teaching with. It did help with perspective -  but we were never on common ground because what we would be teaching would be different.',3,'I think it was great to break it down, but I would\'ve liked to actually dive into the curriculum a little bit more. The breakout rooms weren\'t the most effective because we weren\'t with the right grades','I thought the facilitators were very helpful and very engaging throughout the bootcamp. They knew the curriculum and were willing to answer any questions we had. They also seemed very engaged when teaching and excited about the content.',8,6,3,13,NULL,'I think using the chat in Zoom to answer the questions that Justin and Tara posed. Everyone was allowed to share their ideas and then we could also see everyone else\'s ideas at the same time.'),(14447,1591243200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,4,'Taking a deeper look at the curriculum and gaining a better understanding for it','3',3,4,4,4,4,'Taking a deeper look into the curriculum through the provided work','Providing examples of all grade levels',3,'I felt the facilitators were knowledgeable in the content and able to help us grow in our learning','I wish it could have been in person because maybe there were more activities to help us dive deeper into our learning',8,6,3,13,NULL,'The posts, videos, reading, working with our exact curriculum'),(14448,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',2,4,2,3,2,3,'I don\'t think anything can help us really prepare for life after COVID-19 because we are not there and we do not yet know when we will get there. Having said that, this process has helped our school start to think about how we will start back up and consider the even greater gaps in learning students will come back with.','3',3,4,3,0,0,'Zoom meetings started and ended as on time. Sessions were supported through effective use of technology and facilitators were knowledgeable and helpful.','The Moodle platform was very glitchy on my chromebook. Some of the files would not open and it would not allow me to attach files when work was to be completed and submitted. Apparently it worked better on Windows machines. I feel it is very important in this age of technology to be sure things work across as many platforms as possible.',3,'I did not feel this was as effective as possible using the virtual platform. This is of course beyond anyone\'s control and not at all the responsibility of the presenters who, given the circumstances did an outstanding job. I would most likely have a different overall perspective of the training had we been able to meet in person.','',8,9,0,13,NULL,'Conversations with colleagues and message boards helped me understand how others were thinking and feeling about the content.'),(14449,1591243200,'Louisville School District - Jacob Elementary, KY','Teacher or specialist',4,4,4,4,5,4,'I\'m better prepared to teach remotely because the resources I need are available online.e','3',3,4,4,0,0,'The system was easy to navigate','Having textbooks',3,'Not sure about the program because it\'s new','',8,9,0,13,NULL,'All because this new'),(14450,1591329600,'Fort Dodge Schools, IA','Teacher or specialist',3,3,4,4,4,3,'This is all new to me so I guess I don\'t know how this is going to help me any different then opening if their wasn\'t COVID-19 as my students come to me because they are behind.','3',3,5,5,0,0,'How you could work at your own pace.','I guess next time I\'ll get my assignments and these questionnaires finished closer to when the class is going on.',3,'I guess this is all new to me so I will not be able to rate it until I start using it so I just choose the middle.','no',8,15,0,13,NULL,'The discussions'),(14451,1591761600,'Calcasieu Parish, LA','Teacher or specialist',5,5,4,4,5,5,'It got me thinking about what needs to be priority for FTF learning vs what I can push to a digital platform.','3',3,5,5,0,0,'Engaging with the new guidebooks platform.','Accountability for all members of the breakout session—we had one that barely contributed',3,'Helpful and productive','',6,32,0,12,NULL,'Breakout sessions'),(14452,1591761600,'DeSoto Parish, LA','Teacher or specialist',5,5,5,5,5,5,'helped me dive into virtual learning and to know how the students/parents will feel','3',3,5,5,5,5,'Teachers were upbeat and seemed eager to teach and help us learn.','All was good.',3,'It was nice doing the modules at my own pace and when my timing was good. I liked not sitting through meetings that I had to arrange child care or cancel plans.','',8,34,20,13,NULL,'Watching videos in the modules so I could actually see examples.'),(14453,1591761600,'DeSoto Parish, LA','Teacher or specialist',5,5,5,5,5,5,'It helps on the virtual level.','3',3,5,5,5,5,'The entire professional learning went very well.','I would liked to have had more time to dive into the EL modules in breakouts.',3,'Overall I really enjoyed and learned some great information about the EL.','No',8,34,20,13,NULL,'Unpacking Scaffolds and Support'),(14454,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,5,4,4,3,3,'It gave me a better understanding of the curriculum.','3',3,4,4,4,4,'Learning about the \"why\" behind this curriculum.','More participation within the Breakout Groups.',3,'I chose this rating because I thought the learning went well.','',8,20,34,13,NULL,'Reading what was assigned.'),(14455,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,4,4,4,4,3,'none','3',3,5,5,5,5,'The zoom meetings','More hands on learning',3,'It was the first time to use Zoom Meeting','',8,34,20,13,NULL,'Head, Heart, Habits, & Equity'),(14456,1591761600,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Calmed fears that I would have trouble “adapting” for my students’ needs','3',3,5,5,0,0,'Breakout session conversations','Nothing....very well done!',3,'Well organized and well presented','',6,32,0,12,NULL,'Breakouts'),(14457,1591761600,'DeSoto Parish, LA','Teacher or specialist',3,4,3,3,4,2,'Doing this virtually was extremely difficult and I don\'t feel confident in the content. However, I will research on my own to understand it before school starts','3',3,3,3,3,3,'Seeing a sneak peek of the content','The greek mythology part was not needed. It would be easier to just explain how detailed EL is instead of take an hour and a half talking about Greek mythology to prove a point.',3,'Because teachers need to see how to implement and use a curriculum instead of all the breakout groups and wasted time','',8,20,34,13,NULL,'Seeing videos'),(14458,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,3,3,3,4,3,'Gave me insight to how I will implement EL.','3',3,5,5,5,5,'Easy virtual platform.','A little more insight to the EL website.',3,'The facilitators were kind and helpful.','',8,20,34,13,NULL,'Learning about the module unpacking.'),(14459,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,4,5,5,5,3,'It showed the program should work.','3',3,5,5,3,4,'I learned about the program and how it should work in the classroom','Stay with the same breakout groups -  I think doing it one week and not spread out over 3 weeks.',3,'It was organized and planned out well.','I wish the skills training was not over a 3 week planned . I feel it should be in one week.',8,34,20,13,NULL,'THe break out groups'),(14460,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,4,4,4,4,3,'It helped me process how EL should be taught.','3',3,4,4,4,4,'I learned about the program and how it should be carried out.','stay with the same break out groups so you are comfortable. not having it spread out for three weeks.',3,'it was organized and planned out well','skills session planned out over a week instead of three weeks',8,34,20,13,NULL,'Break out groups'),(14461,1591761600,'DeSoto Parish, LA','Teacher or specialist',5,5,5,5,5,3,'na','3',3,5,5,5,5,'Zoom Calls','In-person training',3,'I still feel unsure about how to implement EL with confidence','',8,34,20,13,NULL,'Discussion Forums'),(14462,1591761600,'DeSoto Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Better prepared','3',3,5,5,5,5,'Working with others.','Better experience with zoom.',3,'Because the training helped me.','',8,20,34,13,NULL,'Breakout groups'),(14463,1591761600,'Calcasieu Parish, LA','School-based coach',5,5,5,5,5,5,'Digital learning platforms','3',3,5,5,0,0,'Breakout rooms','Maybe a larger breakout room with all those teaching my grade level?',3,'It was in-depth, hands-on, ready-to-use information','Thank you!',6,32,0,12,NULL,'Breakout rooms with peers teaching same materials'),(14464,1591761600,'DeSoto Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Virtual training','3',3,5,5,5,5,'All','it was fine',3,'It is very helpful','',8,20,34,13,NULL,'All'),(14465,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,3,4,4,4,3,'It introduced me to some of the basics to EL.','3',3,4,4,4,4,'The fluidity of the way the lessons were laid out.','Having more slide presentations instead of videos. I was unable to watch videos at home due to limited internet access.',3,'It was good enough to share with other colleagues.','',8,34,20,13,NULL,'Reflections'),(14466,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,4,4,4,4,4,'It has helped in preparing me for the new curriculum.','3',3,4,4,4,4,'I gained knowledge of the EL curriculum.','Being able to see someone teach a whole EL lesson.',3,'They will learn about the EL curriculum..','No',8,20,34,13,NULL,'The activities using the modules and the videos.'),(14467,1591761600,'DeSoto Parish, LA','Teacher or specialist',2,3,3,2,3,2,'I wanted to learn everything I needed to know about implement this curriculum. Instead I feel like all of the time was spent on the \"why\" of this curriculum. I felt like the assignment were long and tedious and should have been worked on together with other teachers. At the end of this we do not know the \"how\" of the curriculum and that is what I was looking forward to so that I give my students the best.','3',3,4,3,4,3,'Zoom meetings','Much more time in Zoom meetings discussing curriculum -  listening from the experts -  more sharing with each other and more on implementing this program. I feel like 90 percent of the workshop took place on our own -  without a lot of instruction. I wish it would have been more like a up close and personal workshop -  like I am familiar with.',3,'The presenters were great; the workshop itself left me wishing for more information about how to teach the material. That part was disappointing.','',8,20,34,13,NULL,'watching videos of actual classes and learning taking place'),(14468,1591761600,'Calcasieu Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Thinking about teaching this new unit and which lessons to set up as synchronous and asynchronous.','3',3,5,5,5,5,'The breakdown of the new unit, navigating of the new resources.','More time to dissect the lessons and unpacking targets',3,'It is essential if people are going to teach from this new platform and these new units.','',6,32,29,12,NULL,'Breakout groups/discussion'),(14469,1591761600,'DeSoto Parish, LA','School-based coach',3,3,3,3,3,3,'Just doing Zoom was a learning experience!','3',3,5,5,5,5,'working through Moodle at my own pace','More precise model used inside the LZ platform',3,'Needed a clear model inside LZ','',8,20,34,13,NULL,'Moodle Platform'),(14470,1591761600,'Calcasieu Parish, LA','TAP Master teacher',5,5,4,4,5,3,'I’m still unsure how school will look in the fall, virtual vs face to face, but that is something that has yet to be determined','3',3,5,5,0,0,'The collaboration with my same grade l