ist',4,3,4,3,3,3,'The only thing that has helped me was the final meeting seeing where to login to learn zillion and start preparing and the module/unit unpacking. I felt the other stuff was not related to the curriculum.','3',3,4,3,4,4,'The unpacking of the module and units.','Knowing ahead of time that most of the content wouldn\'t even be about implementation of the curriculum.',3,'Understanding the reasons why this curriculum was developed is important, but took up too much of the time that should have been spent more on the actual modules/units and how to implement them in the classroom or virtually.','',8,20,34,13,NULL,'The unpacking of the module and units.'),(14476,1591761600,'DeSoto Parish, LA','Teacher or specialist',3,3,3,3,5,4,'Learning how to conduct a class online. Really like the chat box.','3',3,4,4,5,5,'breakout sessions and chat boxes','experience using this platform; some things were hard to find and know what to do with',3,'Navigation was confusing. For example, to submit an assignment you had to press submit 3 times. I found out I hadn\'t on the first two sessions so I was late posting. I found out when I went to double check I had done everything. Maybe my screen was not big enough to show everything I needed to do.','',8,34,20,13,NULL,'one pager overviews of curriculum sections'),(14477,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,4,4,4,4,4,'Not sure yet :)','3',3,5,5,5,5,'I really liked the teahing lab platform.','Fewer sessions -  some of them could have been combined.',3,'I think i choose this rating because the training was great but you have to be fairly comfortable with technology.','No',8,20,34,13,NULL,'The videos and reflections.'),(14478,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,4,3,4,3,2,'Getting to know the curriculum','3',3,5,5,5,5,'Breakout groups','Clearer access to materials',3,'I feel like I learned more about why the curriculum was made, and less what it looked like day to day.','',8,34,20,13,NULL,'Breakout groups'),(14479,1591761600,'DeSoto Parish, LA','Teacher or specialist',5,5,5,5,5,4,'More confident with the materials.','3',3,5,5,5,5,'I love the break-out groups to discuss content by grade-level','I would love to have had more time with my grade level team during break -out sessions.',3,'Great introduction to the curriculum and now I want to dive deeper to learn more.','Great platform for learning.',8,20,34,13,NULL,'Break-out discussions as a grade level.'),(14480,1591761600,'DeSoto Parish, LA','School-based administrator or supervisor',5,5,5,5,4,5,'Having the virtual piece to it is going to be helpful.','3',3,5,5,5,5,'The thorough description of the curriculum by the facilitators.','.',3,'It was very thorough and relevant to student learning.','',8,34,20,13,NULL,'Group activities.'),(14481,1591761600,'DeSoto Parish, LA','School-based coach',5,5,5,5,5,5,'It\'s online.','3',3,5,5,5,5,'Looking at the curriculum','More time in the lessons',3,'It is an overview.','',8,20,34,13,NULL,'Maps'),(14482,1591761600,'DeSoto Parish, LA','Teacher or specialist',5,5,5,5,5,3,'This course has prepared me to teach the curriculum under normal circumstances. I am unsure how this would look in a virtual situation.','3',3,5,5,5,5,'I feel that the meetings went well. They did a great job of grouping us so that we could meet with other teachers from our grade level and get a deeper understanding.','Being able to meet in person would have been better for me. Since that was not possible I feel that this was as good as it could be!',3,'I really enjoyed the course!','',8,34,20,13,NULL,'The reflections helped me the most.'),(14483,1591761600,'DeSoto Parish, LA','Master Teacher',3,4,4,3,3,3,'I think this course provided virtual connections with the curriculum that teachers can utilize.','3',3,5,5,5,5,'I think we received a good basis for the why and how to start to comb through the curriculum.','I think viewing the curriculum through the Learnzillion platform would have clarified things