ions I completed were extremely vague. I also feel like I need to be able to hold the complete curriculum in my hand in order to put it all together in my mind. Changing from tab to tab to try to find what is being talked about in zoom meetings and in the sessions is extremely overwhelming. I feel like I would have learned much more from the Bootcamp if I had a copy of the curriculum. \n I also do not feel that we can always assume that everyone has the same level of understanding about technology. Some of us get left behind because of technology.','',8,34,0,13,NULL,'The zoom calls and videos embedded in the assignments helped me the most.'),(14518,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,5,5,5,4,4,'I have learned ways to scaffold the learning and offer extra support to the students as they return to an active, learning environment.','3',3,5,5,0,0,'The instruction and materials were aligned closely and it was helpful to already have access to the materials. The assignments were practical and applicable to my planning process. The articles and information were relevant and will be a great reference of ongoing support as our school implements this new curriculum.','I believe more interaction with module lessons and visual models of those could have prepared me in a deeper way for the upcoming school year.',3,'The hands-on learning part of this PD was instrumental in familiarizing myself with the curriculum.','',8,34,0,13,NULL,'Unboxing the unit and modules, supports and scaffold for all learners'),(14519,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,4,4,4,4,3,'It did give an example of what a virtual class lesson could look like.','3',3,4,4,0,0,'The material was presented clearly and effectively.','It not being virtual.',3,'It was a great overview of not only the curriculum but also the values and goals behind the company.','',8,34,0,13,NULL,'The sessions'),(14520,1591761600,'DeSoto Parish, LA','Teacher or specialist',4,5,4,5,5,3,'I feel tha