 this.','no',15,15,35,13,NULL,'The breakout rooms and being able to listen to teachers who piloted it.'),(14566,1592452800,'Fort Dodge Schools, IA','School-based administrator or supervisor',5,4,4,4,4,5,'A lesson modeled virtually- was very helpful.','3',3,5,5,5,5,'Multiple activities that kept the group engaged','examples on how to implement independent rotations while teaching virtually',3,'The facilitators did an excellent job incorporating numerous activities to keep the group engaged and they provided opportunities for teams to work together to create systems and structures to roll out day one of implementation.','',15,15,35,13,NULL,'Experiental lesson and holding the group accountable for their work'),(14567,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',4,5,3,4,4,4,'N/A','3',3,5,5,5,5,'The community and learning from others as well as the instructor.','N/A',3,'N/A','N/A',15,15,35,13,NULL,'Discussion'),(14568,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',4,5,3,4,5,4,'Learned about some virtual activities if we have to have school over a virtual format in the fall.','3',3,5,5,0,0,'Lots of questions answered.','Not had the course during our un-contracted time in the summer.',3,'The content is very helpful.','',15,15,0,13,NULL,'Model skills lesson.'),(14569,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',5,5,4,5,5,4,'It gave great advice and tips on how to get the most out of skills block!','3',3,5,5,5,5,'Using and seeing real examples','actually have students to realistically think about',3,'It was very thorough and realistic','',15,15,35,13,NULL,'the planning template for skills block whole group and small group'),(14570,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,4,'how to teach a lesson online','3',3,4,4,0,0,'constant feedback and willingness of everyone to listen and learn from each other','dont know',3,'great way to get a strong understand of skills block and to set you up for success on implementing it','',15,15,0,13,NULL,'planning and assessments'),(14571,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,4,5,5,'The students will be able to follow along with minimal supplies','3',3,5,5,0,0,'I have a better understanding of how the Foundational Skills work','I think it went well',3,'Easy to go back and reference','',8,15,0,13,NULL,'breakout sessions/videos/reading supplements'),(14572,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',4,4,5,5,5,3,'Saw a video clip and experiential that showed how it might look','3',3,5,5,0,0,'Getting the basics for implementation','digging into specifics on SG and Independent rotations. That was hardest for me when implementing and I still worry that I am not doing it to the best of my ability',3,'In person is always better!!','',15,15,0,13,NULL,'experientials'),(14573,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',4,5,5,5,5,5,'This will help determine what students need and fill in any gaps.','3',3,4,5,0,0,'Learning how Skills Block is to be implemented.','Moodle allowing us to download google docs and communication on assignments.',3,'This was very informative and I feel more prepared while teaching Skills Block.','',15,15,0,13,NULL,'Discussions'),(14574,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',4,3,3,3,3,3,'More examples of how to do this virtually','3',3,4,4,4,4,'I was able to still connect with my peers for help','More assistance in lesson planning for SG & WG. I think I struggle with the freedom somewhat vs what we previously used for foundation skills',3,'I feel that I still have gaps in learning and that will only come with time of teaching the materials','Some of the homework activities were a lot of work especially when doing it by myself (I do not have a grade level team). Some of the 5 or 10 minute breakout sessions to discuss during zoom calls were a little excessive in time allotments.',15,15,35,13,NULL,'videos of it in action'),(14575,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',5,5,4,4,4,5,'Helped me organization and thinking about how that would work virtually','3',3,5,5,4,5,'Adrienne really made herself available and worked hard to help us. I reached out to her and she is so easy to talk to you.','Being together in person!',3,'Just the ease of working with Adrienne and Spencer. She was able to relate to us using her classroom experience. She is so easy going too.','',15,15,35,13,NULL,'Collaborating with other teachers'),(14576,1592452800,'Fort Dodge Schools, IA','School-based coach',5,5,5,5,5,5,'I love how Adrienne modeled lessons virtually that really helped us see what it could look like virtually.','3',3,5,5,0,0,'Everything the content and deliver was just what our district needed!!','to be in person... but it was really good for online!',3,'Excellent content and delivery!','',15,15,0,13,NULL,'the videos, examples, and experientials'),(14577,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',5,4,4,5,2,4,'More explanations on what I struggled with this past year during my time piloting skills. There are still a few areas I am nervous about but overall it was beneficial and helping me with learning more about the skills curriculum and structure','3',3,5,4,4,3,'The video we watched and the articles we read and especially the practice Adrienne gave us during our zoom meeting like the lesson she had for us when we had to be 1st graders. It was very real and very organized!','More time outside of the zoom meetings to work on the sessions with our grade level team. Like discussions and coworking on the sessions.',3,'I learned a lot and some was review and maybe some things could have been more collaborative','',15,15,35,13,NULL,'Adriennes lesson'),(14578,1592452800,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,4,'I will be more prepared to meet my students\' needs.','3',3,5,5,0,0,'Getting a more in-depth view of skills block','If it was in person.',3,'Because it was a good training.','',15,15,0,13,NULL,'Discussions with peers'),(14579,1592539200,'Fort Dodge Schools, IA','School-based administrator or supervisor',4,4,4,4,4,4,'Helped me think about what we might need to do to adapt to online learning and showed me an experiential of how Skills online could look','3',3,5,5,0,0,'She responded to the needs of the group','Not sure',3,'Adrienne is a strong facilitator and supports the schools she works with at a high level','',15,15,0,13,NULL,'Experiential learnings'),(14580,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,3,3,4,3,'We discussed different scenarios but I feel that no one really knows but we will do the best that we can do as we have an awesome staff and Ryan is a fabulous leader!','3',3,5,5,3,3,'The zoom meetings and collaborating with other teachers','overall it was a good experience',3,'If a colleague of mine did not take the training I would tell them that it would help them understand the curriculum better.','',15,15,34,13,NULL,'The zoom meetings and collaborating with other teachers'),(14581,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,4,'Ideas on how to teach virtually','3',3,4,4,0,0,'collaborating','nothing',3,'It was great professional learning','',15,15,0,13,NULL,'all of them'),(14582,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,5,'I love the idea of working as a district level team to share the work load and provide equitable learning for all of our students in Fort Dodge. The virtual lesson helped me see what it could look like if we can not see our kids in person.','3',3,5,5,0,0,'I feel I have a deeper knowledge of skills block. I appreciated the opportunity to work through the materials individually and then process them as a group. I really liked the lesson planning template.','We made the very best of the virtual learning experience. I miss face to face contact with my colleagues.',3,'I found this experience to be very helpful and I know it will help me improve my implementation of skills block.','',15,15,0,13,NULL,'experiential lessons'),(14583,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,4,'It gave us time as a district and grade level to start brainstorming possible ideas.','3',3,5,5,0,0,'I have a much better understanding of how to use the materials.','It was great!',3,'I learned a lot!','',15,15,0,13,NULL,'experential'),(14584,1592539200,'Fort Dodge Schools, IA','School-based coach',5,5,5,5,5,5,'Both seeing and having time to think about how to teach Skills through an online platform','3',3,5,5,0,0,'Quality learning through moodle, great recap during zoom and time to clarify/discuss both whole group and in breakout rooms','nothing',3,'It was a great balance that I felt was developed very well for the needs of both our district and for the time we are in to prepare for school in the fall regardless of what that looks like','',15,15,0,13,NULL,'Moodle activities and through zoom were both done well and supported my learning'),(14585,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,4,'A sense of it is possible to teach in any format when we plan ahead and work together','3',3,5,5,0,0,'Everyone had a voice','My own device being upgraded',3,'It is district supported and initiated','',15,15,0,13,NULL,'Break out sessions'),(14586,1592539200,'Fort Dodge Schools, IA','School-based coach',4,4,4,4,4,4,'I appreciated Adrienne modeling how to do a lesson virtually if necessary.','3',3,5,5,0,0,'..','..',3,'..','',15,15,0,13,NULL,'..'),(14587,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,3,4,'Be more prepared','3',3,5,4,0,0,'Balance of zoom and virtual','time to work with team',3,'Know of no one needing it','',15,15,0,13,NULL,'digging into materials'),(14588,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,5,'It has given me a better understanding of what I am teaching','3',3,5,5,0,0,'Gaining a better understanding of the materials.','Nothing',3,'Because I think everyone needs to have this training.','',15,15,0,13,NULL,'The breakout groups'),(14589,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',3,3,3,3,4,3,'I apreciaed the modeling of the small group lesson, if I were to teach lessons virtually','3',3,4,5,0,0,'I thought the breakout rooms was helpful and the modeling of the lesson was the most beneficial thing for me.','The navigation of the teaching lab was a bit confusing -  but Im also new to it.',3,'I thought it was helpful, but also would have benefited from face to face contact. With the current situation, I know this was not possible.','',15,15,0,13,NULL,'The modeling of how to implement a small group lesson. I am a title one reading teacher, and that helped me a lot to see what it could look like. I would love to even see more if possible.'),(14590,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,3,'I wasn\'t sure about this question. Did it mean preparing to teach if we are online?','3',3,5,5,0,0,'The reflection piece was helpful.','can\'t think of anything',3,'it was flexible and I got a lot out of it','',15,15,0,13,NULL,'The break out rooms and discussions'),(14591,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,3,4,4,4,'It has provided me with more options of things to implement.','3',3,4,4,0,0,'Adrienne did a great job.','NA',3,'Overall, the course was a bit long and drawn out. However, the information was helpful.','',15,15,0,13,NULL,'Ones where we were able to practice the activities ourselves or in small groups.'),(14592,1592539200,'Fort Dodge Schools, IA','School-based coach',5,5,5,5,4,3,'Seeing the experiential lesson made me more confident that we can do this with our students and it will still be engaging.','3',3,5,5,0,0,'It was really smooth with the learning at home and then pulling it together on the zoom.','Obviously face to face learning -  but that was not an option. Maybe at times when we broke out into groups -  instead of it being random -  it could have been in teams? But I also appreciated getting to speak with those I don\'t always get a chance to listen to.',3,'Teaching Lab always does a phenomenal job helping us learn and to see the importance and the way behind what we are doing.','',15,15,0,13,NULL,'I think both the at home learning by ourselves and the group zooms.'),(14593,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',4,5,4,4,4,4,'Emphasized meeting the needs of students where they are at, since many will most likely need instruction from the previous grade level\'s content.','3',3,5,5,5,5,'We actually opened the books to dive into content, did a mock assessment, etc which helped truly prepare us for what it will be like in the fall. It wasn\'t just a superficial overview of skills block and the why, we actually got into the curriculum.','None',3,'Given the circumstances, this online content was very well done, however in person would be so much better.','',15,15,34,13,NULL,'Mock assessment, cycle 1 planning template'),(14594,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,5,4,'A better understanding of skills block','3',3,5,5,0,0,'Overall understanding of what Skills block is and what it entails.','I would have like to have seen more modeling before reading and attempting some of it on our own.',3,'It helped my understanding of what I am implementing next year.','',15,15,0,13,NULL,'When Adrienne modeled a lesson.'),(14595,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,4,'Got to look more in depth at materials, assessments, and module lessons.','3',3,5,5,0,0,'Feeling more comfortable with FS.','Being able to print things off -  but with working from home -  that was not possible.',3,'I think it is a good way to learn, you have time to work on assignments at your own speed, read and reread if necessary, then process new learning altogether.','Facilitator was great, when I was confused she answered my emails so quickly!',15,15,0,13,NULL,'Scoring a benchmark assessment, discussing with small group, determining phase and micro-phase, discussion together choices made of where to start lessons.'),(14596,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,5,'It improved my understanding of FS and how to implement it.','3',3,5,5,0,0,'Organization of materials','This was an amazing experience.',3,'The sessions work and virtual portions were very beneficial.','',15,15,0,13,NULL,'Session 6 & 7 (experiential lesson and assessment practice)'),(14597,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,4,'Finding out that some activities can be done over zoom.','3',3,5,5,0,0,'The organization of the zoom meetings','Nothing',3,'It was not only an easy way to learn the material, but I was able take away knowledge from the meetings.','',15,15,0,13,NULL,'The breakout sessions were very helpful - the ability to talk to colleagues about instructing FS in a small group setting. The videos that we were watching also helped my understanding of what the expectations were during the small group time.'),(14598,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',4,4,4,4,4,4,'How to plan','3',3,4,4,0,0,'I really liked learning about Foundational skills block','nothing',3,'I really liked it','',15,15,0,13,NULL,'Zoom activites'),(14599,1592539200,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,3,'I am thinking about what needs to be taught face to face and what can be practiced independently if we use a hybrid approach this school year which is likely.','3',3,5,5,0,0,'Sequence of the sessions was good to help us understand the \"why\" of FSB and the specific components of the program.','Some teachers did not share thoughts in break out sessions and it was difficult when they did not offer feedback and collaborate.',3,'I \"piloted\" this program in 1st grade last year and after this bootcamp I have a much better understanding of the curriculum. I think