y intervention given and their progress.','3',3,3,5,5,5,'The information is GREAT!','Better organization of materials. With the virtual mode -  please consider getting online 15 minutes early to aid everyone in finding and having available (finding the downloads -  copying them in order to write in)for their use during the workshop. If we had had a few minutes together to do that -  everyone could have been on the same page from the beginning. Instead -  we had people figuring things out at different times and keeping them from being able to concentrate on the material and discussion.',3,'Despite any problems locating the proper materials, the content is too important not to know. Every classroom needs these things in their toolbox.','I hope that our district ELA teachers can get together and come up with some basic ways to organize this in our classrooms as a whole. We now know what small group instruction looks like and how to begin and assess, but implementing it with ALL of the students that are also at their seats is another story. If we could share ideas and come up with how that will look then each teacher can make that their own by tailoring it to their unit/class needs as they become more comfortable managing the differentiated instruction and the rest of the class. What does the rest of the class look like? How do we make sure that they are working on relevant assignments and skills?',29,26,27,12,NULL,'The fact that I had paper documents and samples of everything to study.'),(14622,1593057600,'Pointe Coupee Parish, LA','Teacher or specialist',3,4,5,5,4,4,'This method of learning is difficult when you cannot find the correct materials.','3',3,2,4,5,5,'Seeing the process of the data, charts, and how to track a student\'s progress in order to understand what supports that student needs.','My experience could have been improved by having the paper documents match the page numbers the facilitator was on. I was focused on finding my place rather than listening. 