enup resources, it showed me examples of using zoom effectively (breakout groups, etc.), and got me in contact with other teachers to make a shared drive.','3',3,5,5,5,5,'It had good focus (it did not feel like a scatter of techniques) and the learners kept engaged.','It would be better to always have questions displayed and materials links easily accessible from zoom breakout groups. This is a problem with Zoom. Once you go to Breakout groups -  you cannot see what was displayed in the main room. Sometimes the facilitators forgot to take the extra steps to display questions and materials in the breakout groups from the beginning.',3,'It is GREAT for newcomers and very good for 2nd year EL users like me. For more experienced ones, I don\'t know.','The facilitators were knowledgable, focused, and not just friendly, but warm.',8,3,20,13,NULL,'The structured readings were best for me, together with their reinforcement by lecture and learner sharing on zoom.'),(14676,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,4,4,4,3,3,'It allowed me to have a greater understanding of the content so that I can feel confident in implementing it','3',3,4,4,0,0,'The online courses','Slightly shorter online work modules',3,'I think it was informative for someone who has not taught EL yet','',8,9,0,13,NULL,'The dive into assessments'),(14677,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,4,5,5,5,2,'N/A','3',3,4,4,4,4,'The zoom meetings were smooth; very few hiccups. The content was very relevant and the facilitators were professional and knowledgeable.','Nothing comes to mind.',3,'Because the content was relevant and engaging. I also appreciated the time commitment not being too long.','',8,3,20,13,NULL,'The experiential activity where we role played as middle school students reading two texts.'),(14678,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,4,5,5,4,4,'It helps to have a more nuanced, in depth understanding of the curriculum so that I am better able to make the appropriate accommodations for remote learning.','3',3,5,5,5,5,'The activities and assignments were challenging and thought provoking, and the group activities were well planned and executed to allow for time for peer interaction and learning.','Sometimes it was a little confusing figuring out how to complete and turn in assignments on the platform.',3,'I feel much more comfortable and capable with the EL curriculum and ready to begin planning and collaborating with my school team to plan for the coming school year.','',8,6,9,13,NULL,'I felt like I got the most useful learning from Sessions 11 and 12'),(14679,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,3,1,'Offered another course to help with distance learning.','3',3,5,5,5,5,'I liked the Zoom.','More time in breakout sessions.',3,'I learned a lot and feel prepared to try activities.','',8,9,6,13,NULL,'Looking at the EL modules.'),(14680,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,2,'n/a','3',3,5,5,3,3,'Well-organized... the PD itself modeled the shifts in the curriculum and the ways we should be teaching it. Mandi was a great facilitator.','I wish I was a faster reader. There was a LOT to read and learn in this PD. And I\'ve only touched on a small amount of what is available. The independent assignments for some of the sessions felt overwhelming.',3,'Same reasons stated above - well-organized, good modeling for our own implementation, excellent presenter, etc.','Thank you for offering this training.',8,9,6,13,NULL,'Any activity which first started with jotting down notes and compiling my thoughts and ideas before writing'),(14681,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,4,4,4,4,4,'I have a greater understanding of the EL curriculum','3',3,5,5,0,0,'The information was clearly presented','It was great',3,'The information was very useful to implementing the EL curriculum effectively','',8,6,0,13,NULL,'Looking at the supports in the curriculum'),(14682,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,5,'First of all, I would like to commend Tara and Kristen for a job well done. The course is very helpful because it has given me a clear view of 6th grade curriculum (I serve K-8 students as RSP teacher); I gained more ways on how to improve my classroom/virtual classroom as a whole and I found another professional learning community that I could celebrate and tap.','3',3,5,5,5,5,'The module, zoom and assignment coincides well and very helpful for me to internalize information.','Everything is fine. If I don\'t take other online classes -  I could have been more focus and on time for submitting boot camp assignments.',3,'The facilitators are awesome and the platforms used in delivering the PD is effective and efficient. Aside from that, I could use the information and strategies that I learned in my classroom.','Thank you for the learning opportunity. I wish you well and may you have more teachers to enlighten in your training. May God bless your organization more.',8,20,3,13,NULL,'Assignments and breakout sessions in zoom.'),(14683,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,4,4,5,5,'Implementing the new curriculum - since I had 0 understanding before.','3',3,5,5,0,0,'The facilitator, Justin, was really excellent.','Being in person.',3,'I had an overall pleasant experience.','Thank you!',8,6,0,13,NULL,'Breakout groups with my partner teacher, which only happened once.'),(14684,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,5,4,4,3,4,'I have more tools to use when thinking about th eupcoming year and for planning it.','3',3,4,4,4,4,'Most of this session went well.','Having access to materials earlier so I had more time to complete.',3,'I feel any colleague would learn from this ttraining.','',8,9,6,13,NULL,'The reading and activities I could do on my own without the pressures of a timer.'),(14685,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,4,'I was able to form relationships with colleagues across the district, and we will be able to plan together in the fall.','3',3,5,5,5,5,'I thought the flow of activities (mindset to application) was well designed.','I would have loved to see some model lessons of EL done virtually.',3,'I really enjoyed my facilitators, Kristen and Tara!','',8,20,3,13,NULL,'I really enjoyed working with my grade level group. I liked discussing our unpacking and our visions together.'),(14686,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,3,'Some of the techniques in the Zoom meetings helped me see how to host a Zoom class meetings could run more smoothly.','3',3,5,5,0,0,'Enjoyed the combination of direct instruction, breakout rooms with colleagues and the asynchronous work.','Possibly more days taking an even deeper dive.',3,'It was well-organized. Presenter was excellent and very easy to understand. Co-host was efficient, making the meeting run smoothly. Good content.','Looking forward to the development of more digital support for teachers.',8,9,0,13,NULL,'breakout conversations and asynchronous work'),(14687,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,4,'We discussed ways to implement Anchor charts through Google docs and group discussions through Zoom breakout rooms.','3',3,5,5,0,0,'We were given a great overview on how to approach the curriculum which included the why as well. We were given strategies to implement the units online if need be.','It would have been nice to meet in person but that wasn\'t really doable.',3,'The facilitator was very helpful, personable, clear, and welcoming.','Facilitator made me feel welcome and was very engaging.',8,6,0,13,NULL,'Break out groups where we discussed specific parts of the EL curriculum.'),(14688,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,4,5,5,4,4,'Heard about zillion','3',3,5,5,5,5,'Lots of information','unsure',3,'I think it\'s good if you\'re starting EL and never used it before','',8,9,6,13,NULL,'Live calls'),(14689,1593662400,'West Contra Costa USD, CA','Teacher or specialist',2,3,3,3,4,4,'It reminded me that my teaching was a good career choice.','3',3,5,5,5,5,'Mandi had a a clear aspect of the curriculum and I am sure it wasn\'t easy to facilitate in this this way. Kudos to her.','It would have been great if I had breakout room with my team since we were on Mod. 4 I would have liked to explore Mod 4 sine we didn\'t get to it this year.',3,'Because I thought that the homework were asked to do seemed like a bit of \"busy work\' to be honest. I would have liked to dig into Mod 4 as I stated above.','n/a',8,9,6,13,NULL,'What out goals are :looks, sounds and feels like'),(14690,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,4,4,'They recommended another course.','3',3,5,5,0,0,'Great time management, smooth transitions, and clear expectations.','I may have liked having the same group more often in order to form more community.',3,'I enjoyed it and i believe it was helpful.','',8,9,0,13,NULL,'Breakout rooms'),(14691,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,4,'The use of Universal Design in teaching and learning, the equal opportunity for the students and how I may be able to collaborate with the general education teachers to support our students with special needs.','3',3,5,5,5,5,'The zoom meeting with breakout session. pre self assessment and post self assessment.','I need to learn more about the modules.',3,'The bootcamp is one way of learning, specially if there is something new. EL is something new to us, teachers should attend the training to master the knowledge of the teaching pedagogy and its implementation. Nobody can\'t teach what they don\'t have.','I wish the District could also offer us an advance training to learn more about this curriculum and required all teachers who are using the curriculum to attend.',8,9,6,13,NULL,'Module assignment and self reflection.'),(14692,1593662400,'West Contra Costa USD, CA','Teacher or specialist',3,4,2,4,4,4,'I am more familiar with the curriculum. I feel more confident and knowing what to teach and the best way to implement the information.','3',3,4,4,0,0,'I liked the screen share slides.','I thought it was too much homework. the short answers where we had to respond to others was good but then we had to submit more work was tough for me to stay focused.',3,'It was a lot of information in a short amount of time. The information is useful.','',8,9,0,13,NULL,'I liked the breakout rooms. It was helpful to talk with other to get ideas.'),(14693,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,5,4,4,5,3,'I learned the basic structure of the curriculum and how to use it, but not how to adapt it to a virtual world.','3',3,5,5,5,5,'Wonderful community, wonderful positivity. The content covered was deeply relevant, but we talked about them in a broader sense that made us think about more than just the letter of the curriculum.','More talk about adapting to an online format. Maybe some calendering?',3,'Even for teachers with experience, and I can\'t think of any better way for them to get to know the model. (It\'s not a 10 because some teachers don\'t want to know the curriculum models all that closely).','',8,3,20,13,NULL,'The unboxing procedure.'),(14694,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,4,'Learning targets and understanding the shifts and the context','3',3,5,5,0,0,'Collaboration with others. Understanding the shifts more fully now.','Wish we had posters to work together and share our findings.',3,'This PD was very beneficial for helping implement the new program. The information was great.','',8,9,0,13,NULL,'Working in small groups with others. Especially looking at performance task and lessons.'),(14695,1593662400,'West Contra Costa USD, CA','Teacher or specialist',3,2,4,3,3,2,'I wish there was more focus on how to prepare for school opening in the Fall. There was some mention, but I still felt like we could\'ve dedicated a whole session or half a session to resources/ what structures and protocols we can use for online learning.','3',3,4,4,4,4,'I liked the focus on the bigger picture of things and the WHY behind the curriculum.','I really wished we had more support with looking at the curriculum -  and what planning should look like. Maybe even a modeled lesson. I still feel lost. I feel like this was more of a PD that was a \"buy in\" on this curriculum -  and not so much tools to using it.',3,'If you want to know more about the WHY in the curriculum, and have more collaboration I think this is great. But, as someone with no clue what is going on or what EL really is, things didn\'t feel as helpful. I do feel excited to begin this curriculum, but I also feel overwhelmed because I don\'t know where to start.','',8,6,9,13,NULL,'The calls were most helpful in my learning!'),(14696,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,4,5,5,4,'Discussions with other teachers, Justin\'s ideas, collaboration.','3',3,5,5,0,0,'Collaboration with other teachers. Justin\'s lessons.','n/a',3,'It gives you insight into the EL curriculum.','',8,6,0,13,NULL,'Working with other teachers to talk about the curriculum.'),(14697,1593662400,'West Contra Costa USD, CA','Teacher or specialist',3,3,3,3,4,4,'I am familiar with the curriculum that I had never heard about until a month ago.','3',3,3,3,3,3,'I liked the concept of student enpowerment.','Put the book in our hand.',3,'I\'m burned out from the school year and the idiot president. I think everyone needs a break.','',8,6,9,13,NULL,'Personal learning through reading and docs.'),(14698,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,5,'The intro to the new EL was tremendously helpful in preparing me to implement the curriculum in any setting (in school, virtual, hybrid)','3',3,5,5,5,5,'Great group of teacher and wonderful facilitators. I was very impressed with the online Teaching Lab design. Good mix of activities- very strategic.','In person :)',3,'The EL curriculum is excellent, but can be overwhelming. I believe this bootcamp is essential to help teachers successfully enter into teaching the program.','',8,3,20,13,NULL,'Hard to choose'),(14699,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,5,'I am much more confident in how the curriculum works and was able to gather a lot of online resources that will help, if we continue with virtual learning!','3',3,5,5,5,5,'Justin did a fantastic job of facilitating our group. He was amazing at answering all questions and made everyone feel very comfortable.','I would have loved to have more time to dig into everything deeper!',3,'I thought the PD was very informative, fun, and well balanced.','',8,6,9,13,NULL,'Discussions, zoom calls, readings, videos'),(14700,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,4,3,5,3,'Understanding a new curriculum, discussing ways to teach it virtually','3',3,5,5,5,5,'Collaboration with other teachers; dissecting the curriculum and the why\'s of the design','More focus on individual grade curriculum-more tangibles',3,'It gives a great background of the curriculum and how-tos for implementing it effectively','Justin and Mandi were great!',8,6,9,13,NULL,'Unpacking the Module'),(14701,1593662400,'Cincinnati Public Schools/ STRIVE, OH','Teacher or specialist',4,4,3,3,3,4,'This course has helped me put together a plan for this upcoming school year, in terms of how to go about planning. I am excited but also nervous moving forward. ','3',3,4,4,4,4,'I loved learning about this new idea of accelerated learning. I also enjoyed the time that was given to look at our current curriculum, and kind of \"map out\" an idea of how we are supposed to implement this technique of accelerated learning, as we plan.','Making sure that everyone is prepared ahead of time. This isn\'t really a TL issue -  more of a district issue -  but a lot of my breakout time -  on the third day -  was wasted because someone didn\'t know where to access the curriculum guide or curriculum itself. Therefore -  just reminding participants of items that they will need to make sure they have access to -  while participating. I know I\'m going to sound like my kids here -  but I wish we were in person :) (which I know is out of your control). ',3,'I love learning, and I was upset that I wasn\'t allowed to attend the TL PDs this past school year. So the fact that I was able to sign-up as one of the participants made it that much more fun for me :) I also LOVE Tamala and Ryan!! ','',18,25,28,11,NULL,'The second day\'s activity, looking at the standards and activities. '),(14702,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,4,'This course helped me by recognizing some outside resources I can use during COVID and after COVID.','3',3,5,5,0,0,'Justin was an AMAZING facilitator and really clearly created a virtual community that was warm and welcoming.','I think more examples of student work and outcomes would be neat to see.',3,'I would highly recommend because of the effectiveness of the learning and the organization of the PD. Justin did a fabulous job facilitating and the assignments were reasonable and helpful.','',8,6,0,13,NULL,'The independent readings and asynchronous work.'),(14703,1593662400,'Cincinnati Public Schools/ STRIVE, OH','Teacher or specialist',5,5,5,5,5,5,'know \"HOW\" to approach planning this year','3',3,5,5,5,5,'time together to collaborate','N/A',3,'Very informative and provides a clear roadmap to instructionally plan','N/A',18,25,28,11,NULL,'the documents of questions to think about when planning, the articles shared'),(14704,1593662400,'Cincinnati Public Schools/ STRIVE, OH','Teacher or specialist',4,5,4,4,5,3,'Gave me a sense of direction with my future lesson planning','3',3,4,5,5,5,'Brought up good teaching strategies that we seem to overlook the older we get :)','Having our textbooks as examples',3,'I would want to have more time to use these ideas with our curriculum','Thank you!',18,25,28,11,NULL,'When we go through a lesson'),(14705,1593662400,'Cincinnati Public Schools/ STRIVE, OH','Teacher or specialist',1,5,3,3,1,3,'It forced me to open the online textbook and start getting a little familiar with the standards of Topic 1','3',3,5,5,5,5,'given time to look at the new curriculum, forced to work with the pacing and curriculum guides to start understanding the standards and topics of the first unit','Teaching Lab always spends the majority of the time talking about what we should do -  but not HOW we should do it. We need exposure to actual methods -  not be left to decide how to implement things on our own',3,'Teaching Lab is boring and mostly just stuff we already know','',18,25,28,11,NULL,'time to independently look over the new curriculum '),(14706,1593662400,'Cincinnati Public Schools/ STRIVE, OH','Teacher or specialist',4,4,5,5,4,4,'This opened my eyes to the new curriculum.  This PD also allowed me to realize that I need to spend less time remediating and more time movng forward into conceptual understanding.','3',3,4,4,5,4,'All in all, it was good to discuss math with other professionals in the field during this break.  Always good to keep it fresh in our minds and have these professional conversations.','The time went over a few days but other than that I felt it went great.',3,'This is the only math PD that I have ever felt accomplished afterwards, every single time.','n/a',18,25,28,11,NULL,'I really enjoyed the break out sessions.'),(14707,1593662400,'Cincinnati Public Schools/ STRIVE, OH','Teacher or specialist',5,5,4,4,5,4,'diving deeper into the standards','3',3,5,5,5,5,'learning more about accelerating learning','more time to plan',3,'very informative','no',18,25,28,11,NULL,'understanding the standard before teaching'),(14708,1593662400,'Cincinnati Public Schools/ STRIVE, OH','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'This will help us prepare for the school year, how to help us address unfinished learning.','3',3,5,5,5,5,'Break out groups were great','More time to plan',3,'The presenters always make us feel at ease, are thorough, great presentation slides.','Refresher like this is needed in the fall.',18,25,28,11,NULL,'The reminder of the importance of rigor in lessons and understanding the standards/math to prepare for instruction.'),(14709,1593662400,'Cincinnati Public Schools/ STRIVE, OH','Teacher or specialist',4,4,3,3,3,3,'It helped to be thoughtful of how to address student needs with abreviated time.','3',3,5,5,5,5,'','',3,'It is helpful to remind us to be intentional with our instruction.','',18,25,28,11,NULL,''),(14710,1593662400,'Cincinnati Public Schools/ STRIVE, OH','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,5,5,'I learned so much! I was really concerned about what instruction would look like next school year but now I have a plan','',3,'','Can we do another mid year? ',18,25,28,11,NULL,'Reading the literature and discussions with other teachers'),(14711,1593662400,'Cincinnati Public Schools/ STRIVE, OH','Teacher or specialist',4,4,5,5,5,5,'I\'m ready to plan my lessons.','3',3,5,5,5,5,'The Zoom format was great!','Nothing.',3,'This was great!','No.',18,25,28,11,NULL,'Q & A'),(14712,1593662400,'Cincinnati Public Schools/ STRIVE, OH','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,5,5,'The information/articles were incredibly beneficial.','n/a',3,'This training was so relevant!','',18,25,28,11,NULL,'breakout rooms helped to solidify what we learned'),(14713,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,4,4,4,4,4,'I will have a better understanding of the EL curriculum, set up the protocols and supporting materials needed for struggling students.','3',3,4,4,4,4,'i learned about the EL curriculum, and now I know how to support the Gen Ed teacher in implementing and differentiate instruction to struggling students,','Knowing and understanding the EL curriculum made an impact on my teaching experience -  It is a real challenge as a special ed teacher to guide and support struggling students in their reading -  thinking -  talking and writing skills and ability.',3,'It is very informative and it covers the necessary skills that are essential for students to be successful in their academic endeavor towards college.goals.','Thank you for all the support.',8,6,9,13,NULL,'The protocols, close reading, then the scaffolds and support materials to augment students learning.'),(14714,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,4,3,'During breakout groups others were helpful in offering insight into how they have taught the curriculum online. Justin also offered a few resources that will be helpful to utilize if we teach virtually next year.','3',3,5,5,5,5,'The opportunity to learn how to backwards plan and internalize lessons.','More time to plan for lessons and utilize collaboration time with other teachers in our district.',3,'This is one of the most informative EL trainings I have attended. It was focused and intentionally built to support the planning of this curriculum.','',8,6,9,13,NULL,'Planning documents and explanation of protocols/language dives.'),(14715,1593662400,'West Contra Costa USD, CA','School-based administrator or supervisor',5,5,5,5,4,4,'This course was very helpful in helping me to think more about how to support the teaching of EL virtually.','3',3,5,5,0,0,'It was great to dig into the content before and after the live session. I felt like I had ample time to explore.','It all went really well.',3,'The whole process was well planned and structured. I seem to learn well this way.','',8,9,0,13,NULL,'The guided practice and assignments helped me to better understand how to effectively plan for instruction.'),(14716,1593662400,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,5,'It refreshed my memory on the salient points in the modules.','3',3,5,5,0,0,'The articles and the videos were great.','Maybe more videos will be great.',3,'It was comprehensive.','no',8,9,0,13,NULL,'The break out sessions were great, l had a chance to work with other teachers.'),(14717,1593662400,'West Contra Costa USD, CA','School-based administrator or supervisor',5,5,5,5,5,5,'We are committed to this curriculum so now I can order the materials and plan to support the teachers.','3',3,5,5,5,5,'I think the moodle platform was excellent in getting us primed. I also like from the outset that there was a strictness about turning in assignments and attending sessions, this created a respect and seriousness for everyone\'s time and we all benefited from it. I love that I worked with the same grade level from other schools. Timing and pacing was great.','??',3,'Everything from the pre-work to the facilitation of the meetings was excellent and useful.','I am hoping for additional training to support teams with mapping out their precious collaboration time. I want people to have an idea of how and what they will collaborate about and what is an individuals responsibility.',8,3,20,13,NULL,'The pre shifts/post shifts activity with the greek myth really made us experience the difference of giving context to enhance the comprehension of complex text. I think from then on I knew this training would be excellent.'),(14718,1593662400,'West Contra Costa USD, CA','Teacher or specialist',3,4,3,2,3,2,'It made me begin thinking about how I will implement this curriculum during distance learning.','3',3,3,3,0,0,'I gained a better understanding of the scope and sequence of EL Education and was able to delve into see how the modules and lessons are aligned to the standards and see the different components embedded into each module.','More time to discuss distance learning and hear from others what their plans are around this.',3,'It was difficult for me to really benefit from this training because I felt that it was rushed and teacher\'s voices weren\'t really heard in where they wanted to go with their learning.','',8,9,0,13,NULL,'Being able to speak to other teachers who have already taught EL to gain insight and tips from them on what worked well and what supports were still needed.'),(14719,1593662400,'West Contra Costa USD, CA','Teacher or specialist',1,5,4,5,3,2,'instilled in me the knowledge that being able to easily navigate a platform is extremely important.','3',3,5,5,0,0,'collaboration time / breakout rooms','A user friendly platform the platform was extremely difficult to navigate frustrating',3,'The excellence of the material was overshadowed by the challenges the platform provided.','I would like to take this course again or be able to access the videos and learning so I can revisit it.',8,9,0,13,NULL,'doing homework with my colleagues / learning with my colleagues'),(14720,1593662400,'West Contra Costa USD, CA','School-based administrator or supervisor',5,5,5,5,4,4,'I feel more comfortable with the materials and navigtating the curriculum.','3',3,5,4,0,0,'Organization, meeting intended outcomes, assigned work outside of sessions, breakouts','Making more explicit connection between implementing high quality curriculum and equity and tying it into the social justice movements going on around the world currently.',3,'I\'m better for having attended and my EL practice will be stronger.','Thank you.',8,9,0,13,NULL,'assigned work outside of sessions, breakout sessions'),(14721,1593662400,'West Contra Costa USD, CA','Teacher or specialist',4,5,4,4,3,3,'Knowing how I can utilize protocols and RTTW to ensure all students are dealing with complex grade level texts','3',3,5,5,0,0,'Engaging in the sessions either before or after the calls in a way that made sense and was productive for each session','More time to discuss what we did in the sessions',3,'It d