ons from an online source','3',3,5,5,5,5,'Explanation of material','Nothing.',3,'The overall feel and effective instruction of our facilitators to make sure we understand the material.','Just that it was extremely thorough covering as much material as possible in the time frame we had. The facilitators were passionate about the material and made us equally engaged to know more.',22,26,27,12,NULL,'Practical experience working with the guidebooks from a teacher\'s and from the student\'s side of learning.'),(14774,1594958400,'Louisiana State Content Leader Training, LA','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,4,'I became more familiar with Guidebooks 9-12 and with ZOOM as well.  This will help if we have to go to virtual classes. ','3',3,5,5,5,5,'The new design and content of Guidebooks 9-12 was presented effectively.','Everything was good.  I would not change anything.',3,'I feel that the training was very timely and helpful, the facilitators were great, and the communication among the participants was informative.','I wish all teachers of Guidebooks 9-12 could participate.',22,2,4,12,NULL,'Delving into the units and exploring the teacher and student tools was helpful.'),(14775,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,5,'How to unpack the curriculum and plan for instruction regardless of virtual or brick and mortar presentation.','3',3,5,5,5,5,'Everything! This was very helpful and informative.',' I would like to have copies of slides presented and videos to reference.',3,'This is the type of classroom I strive to have. It had independent and group work, volunteers for questions, and prepared and knowledgeable instructors.','When is the next one??',22,26,27,12,NULL,'Exemplars, breakout sessions, group discussions'),(14776,1594958400,'Louisiana State Content Leader Training, LA','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,4,5,'Teachers will be able to determine what courses can be virtual and which can be face to face.  With the optional activities, it will be easier to help struggling students using the platform as well. ','3',3,5,5,5,5,'The learning experience overall was positive and very informative.','Having a hard copy of the notecatcher.',3,'As a content leader, I know how the guidebooks work but with this training, I really learned so much more about the tools that will benefit both students and teachers in the classroom.  I love the optional activities that are now available and how easy it is to see how the texts/materials are connected to help build knowledge and understanding.','',22,26,27,12,NULL,'Breaking down the lesson, activities, and unit study tool.'),(14777,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,3,'When we talked about annotating lessons, we mentioned how to address certain activities virtually.','3',3,5,5,5,5,'Pacing; We moved through the information at a faster pace because we did not have to wait for conversations to die down','Having time embedded to do some of the unit study tool work with my own grade level units',3,'Before my Teaching Lab professional development sessions, I was very resistant to guidebooks. I wanted to utilize my Curriculum and Instruction degree and remain autonomous. This was unfair to my students especially considering the amount of wasted time we see reported in \"The Opportunity Myth\". Now that the curriculum has included more diverse works, I can see myself teaching the units with more fidelity.','',22,26,27,12,NULL,'Action Planning'),(14778,1594958400,'Louisiana State Content Leader Training, LA','District/network/state-level professional or administrator',5,5,5,5,5,3,'','3',3,5,5,5,5,'The material was clear','',3,'It wasn\'t a 10 simply because of the length of the training. Most don\'t have 3 days to allot to a training plus homework time. I also understand that 3 days isn\'t truly enough to do the curriculum justice. Maybe an option to spread out 1 day a week over 3 weeks? I also see the downside of that as well. It\'s just hard to make it work for everyone.','',22,26,27,12,NULL,'The experiential pieces were helpful to understand the purpose of components.'),(14779,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,4,5,4,3,'It did not help with that.','3',3,4,4,0,0,'Breakout Discussions','The breaks were too long; shorter breaks would have been better.',3,'','No',22,26,0,12,NULL,'Breakout Discussions'),(14780,1594958400,'Louisiana State Content Leader Training, LA','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'The course helped give me ideas on how to plan for virtual learning ','3',3,5,5,5,5,'The asynchronous/synchronous components were really well structured. It felt engaging and not overwhelming in the online environment ','N/A',3,'Teaching Lab always does a phenomenal job with training. They did well with the virtual implementation. This was as effective as the in person content leader trainings ','',22,26,27,12,NULL,'Working with peers, seeing examples, open discussions '),(14781,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,0,0,'Everything ','',3,'Everything went well (the timing, the breaks, the activities)','',22,26,0,12,NULL,'The combination of breakout rooms and whole group instruction'),(14782,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',4,5,2,3,5,4,'I know how I want to decorate my room to improve learning.','3',3,5,5,5,5,'interactions','finding resources',3,'Because we\'ve already gone through this training before','where are the materials',22,26,27,12,NULL,'templates'),(14783,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,2,'','3',3,5,5,5,5,'','',3,'','',22,26,27,12,NULL,''),(14784,1594958400,'Louisiana State Content Leader Training, L