mmensely helpful.'),(14788,1594958400,'Louisiana State Content Leader Training, LA','School-based coach',5,5,5,5,5,3,'','3',3,5,5,5,5,'The flow of our activities and the ability to collaborate with others. ','More time allotted for break out room discussion. ',3,'It was very thorough and informative. ','',22,2,4,12,NULL,'The group collaborations were very helpful. '),(14789,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',4,5,4,4,4,3,'','3',3,5,5,0,0,'','',3,'','',22,2,0,12,NULL,''),(14790,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',4,5,5,5,5,5,'Got me back into the flow and thinking about practical applications','3',3,5,5,0,0,'The facilitator did well and most of the breakout rooms were productive.','The; there were technology glitches and the surveys and time cards did not include my district; that includes this survey.',3,'I am a content leader and was offered the pooprtunity by my district. I wil likely be redelivering what I learned here.','n/a',22,2,0,12,NULL,'Active engagement with my own materials.'),(14791,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,4,4,'Deep dive into guidebooks ','3',3,4,5,5,5,'I liked the way the sessions were broken up...not too much at once.','more time in breakout rooms for some activities',3,'I enjoyed learning the material presented','Great experience',22,4,2,12,NULL,'The materials (note catcher, breakout rooms)'),(14792,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,5,5,'The discussions were thought-provoking and inspiring.','',3,'Katie and Anita were both fantastic instructors.  I was actually a little sad having to leave for the last meeting.  The group of teachers in my cohort were excellent and I loved collaborating with them.','',22,2,4,12,NULL,'The breakout rooms certainly helped in supporting my learning.  Everyone was engaged and comfortable in sharing their thoughts and opinions.'),(14793,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,3,'gave me new tools','3',3,5,5,5,5,'everything went so smoothly and I learned so much','how to use digitally with students (Google Classroom)',3,'Very professional, very thorough, very well designed','The facilitators were amazing!!',22,2,4,12,NULL,'breakout rooms and putting on the student hat'),(14794,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,2,'','3',3,5,5,5,5,'Having a chance to look at the curriculum and how it is structured. ','I can\'t think of anything right now',3,'Our school is currently doing a mix of the old curriculum and new curriculum, so focusing on virtual learning is our priority right now. ','The presenters were great!',22,1,3,12,NULL,'The breakout rooms allowed me to meet and discuss the curriculum with other teachers. '),(14795,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,5,'It prepared me to deliver engaging lessons to ALL of my students.  The training helped me to be able to challenge, engage, and empower my students!','3',3,5,5,5,5,'Breakout Sessions','More Time',3,'Really enjoyed the training','',22,1,3,12,NULL,'Annotating'),(14796,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,5,'I am prepared whether it be after COVID or not.','3',3,5,5,5,5,'Presentations, breakout sessions, homework','I needed better internet connectivity. ',3,'It was a thorough, clear, beneficial training.','Great course!!!',22,1,3,12,NULL,'Breakout session work'),(14797,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,5,3,'That wasn\'t really the focus of our training.','3',3,5,5,5,5,'I loved the break out rooms.  I feel like this training was very well planned and we were engaged.','It was a great experience.',3,'I was engaged and I feel like I learned a lot.','I was scared I was going to hate professional development over zoom, but after this experience and how seamless it was I think I prefer it!',22,1,3,12,NULL,'I love that they treated us like students sitting in a classroom.  We got to see how our students will feel in a few weeks.'),(14798,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',4,3,5,5,5,5,'','3',3,5,5,5,5,'The breakout groups were good because you had teachers from all experiences being able to collaborate. ','There was a lot of jumping around between the resources -  so I was easily lost. It was difficult to keep up with where we were supposed to be unless we were given explicit page numbers and titles when told where to go. ',3,'Because I am not an ELA teacher; I am a Special Education teacher. The teachers I work with have all taken this training. ','',22,1,3,12,NULL,'The bycatch activity where we were able to \"see\" from our students POVs. '),(14799,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',4,4,4,4,4,3,'I feel much better about planning for what comes next. There is so much uncertainty with what will happen next year...but now I know what to do in order to plan lessons for my students. ','3',3,4,4,4,4,'This was a great online learning summit. Everything was communicated very well. ','Being in person (I know that is nearly impossible right now.) ',3,'Because it was great! ','',22,1,3,12,NULL,'The breakout groups '),(14800,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',3,3,3,3,3,3,'','3',3,3,3,0,0,'Breakout sessions day 2','Deeper into content',3,'','',22,1,0,12,NULL,'Annotations of text '),(14801,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,5,5,4,3,'Yes, it was helpful to know how to address these guidebooks and even use some of the resources in a virtual form.','3',3,5,5,5,5,'Breakout Sessions and clear guidance and leading.','More snacks.',3,'Because it was enjoyable!','',22,1,3,12,NULL,'Liked the breakout sessions and the homework portions. The sessions seemed well-informed and were very enjoyable due to the facilitators. '),(14802,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',4,5,3,5,5,2,'','3',3,3,5,5,5,'The breakout sessions were great. Everyone got along and participated and we had great discussions.','More time for the breakout sessions so that we can work together -- it helped keep me engaged in the activities. Maybe more of that time on the third day when we are already getting a bit fatigued from the information load. Having time to talk and work with others breaks that up and makes it feel more productive.',3,'I enjoyed the training over all, but do wish there would have been more time given to allow for planning on our own so we could bring questions to the facilitator. ','',22,1,3,12,NULL,'The breakout sessions.'),(14803,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',4,4,5,5,5,2,'','3',3,5,5,5,5,'','',3,'','',22,3,1,12,NULL,''),(14804,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',5,5,4,4,5,4,'','3',3,5,5,5,5,'The overall information and deep dive into the new curriculum. ','More time to work on the lesson that we will be teaching. ',3,'Great training, but we do need time to work on our own units. ','',22,1,3,12,NULL,'Reviewing the curriculum Hub'),(14805,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',3,5,4,5,4,3,'','3',3,3,4,5,4,'Some of the break out rooms ','A printed copy of the notecatcher',3,'','',22,1,3,12,NULL,'The bycatch, and the annotating the teachers notes '),(14806,1594958400,'Louisiana State Content Leader Training, LA','Instructional coach',4,5,4,4,5,2,'','3',3,5,5,0,0,'','',3,'This training built strong knowledge about the importance of text complexity and background knowledge and how to internalize a unit and lesson. However, the content was redundant for people with experience in this area. I thought the training was going to be more oriented towards how Guidebooks 3.0 differ from 2.0 and how to engage with new features like the Application unit.','',22,2,0,12,NULL,''),(14807,1594958400,'Louisiana State Content Leader Training, LA','District/network-based coach or Curriculum and instruction specialist',4,5,4,4,4,3,'','3',3,4,4,4,4,'She described the \"why\" portions of the guidebook well.','',3,'','',22,26,27,12,NULL,'Interacting with Louisiana Curriculum Hub. '),(14808,1594958400,'Louisiana State Content Leader Training, LA','Teacher or specialist',4,4,3,5,4,4,'I know how to implement the Guidebooks lessons better with my own students and to help other teachers understand it.','3',3,4,4,4,4,'The presenters were well knowledgeable, and everything was well timed.','The note catchers were confusing sometimes -  because the pages weren\'t always mentioned -  or the content wasn\'t always in the same area as we were reviewing.',3,'It was great, and just a few improvements with the note catchers will make it perfect.','N/A',22,26,27,12,NULL,'Actually doing examples with the books and activities from the 10th grade unit.'),(14809,1596168000,'Building 21 - Allentown, PA','Teacher or specialist',4,5,3,4,5,2,'','3',3,4,4,0,0,'I was able to analyze lessons to help prepare for \"just in time\" learning. I will be asking myself specific questions when deciding how to best help students. I know how to navigate IM better to help me answer those questions. ','If the facilitator could have modeled how they used our individual pre-work to edit the lesson. I do not see why we even needed to fill out the diagnostic survey. ',3,'I have an improved mindset on how to handle types of unfinished learning in the classroom. ','No',18,24,0,11,NULL,'The breakout room discussions about our specific content. '),(14810,1595217600,'Washington Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Unfortunately, one of the primary concerns for school opening after COVID-19 are all the \'unknowns\' on top of the epidemic itself. However, this course was taught in a way that actually helped ease the unnecessary anxieties with school beginning and helped find solutions to potential struggles produced by the virus; such as internet restrictions, one to one meetings. Lauren made many great suggestions and asked us what we thought may be suitable solutions. She helped us remember to be thinking forward when it comes to these relational meetings. It may not be as easy to conduct a meeting over coffee but doing one virtually. Furthermore, we were allowed to collaborate with our peers, which as we all should know by now, is fundamental to creating an effective professional learning community.','3',3,5,5,0,0,'I felt as though this course really brought everything, no pun intended, full circle from previous modules. By the end of the module I felt as if I could conceptualize everything from before, up to the end of the course.','Nothing',3,'I already have suggested this to many other teachers in other parishes. Two of my friends have already begun an open dialogue in two different schools located in New Orleans lower 9th ward school system!','None',6,29,0,12,NULL,'Having the time to discuss articles, being able to hear others ideas, being prompted to really reflect on the data/materials without any leading questions. The open-ended questions require you to remain engaged and also challenges your pre conceived thoughts by digging deep into the content. This also helps build confidence.'),(14811,1596168000,'Building 21 - Allentown, PA','Teacher or specialist',4,5,4,4,5,3,'Has started me thinking and planning.  It would be so much more helpful if I knew what scheduling etc. were going to look like.  I don\'t even know what type of attendance requirements there will be for our students.  But at the very least, this session has helped me to think more clearly about focusing learning activities on the aspects of Rigor that are important.','3',3,4,4,4,4,'the engagement and participation of our colleagues.  Lots of ideas generated, and the discussion will continue.','Previewing the slides for the Zoom call?',3,'Most of us are here','',18,24,25,11,NULL,'Actually, the pre-work was a really good set-up.  I probably could have previewed the slides for the call to focus more.'),(14812,1596168000,'Building 21 - Allentown, PA','Teacher or specialist',4,4,4,4,4,4,'Opening a conversation among colleagues of what is changing in our delivery of the material','3',3,4,4,0,0,'Casual discussion and learning new strategies','creating an online set of resources to begin using in September',3,'It was more general and introductory, and less productive than expected, I wanted to delve into more topics and additional units for planning purposes','Moodle was easy to follow along with during the course, instructor modeled positive teaching strategies',18,24,0,11,NULL,'breakout rooms'),(14813,1596168000,'Building 21 - Allentown, PA','Teacher or specialist',3,4,4,4,5,4,'IM prioritizing lessons within the units.','3',3,4,4,4,4,'It was a good way to begin the mindset in preparing the new school year.  Thinking about the loss or unfinished learning and having a strategy to work with.','n/a',3,'','More time within the breakout rooms.',18,24,25,11,NULL,'n/a'),(14814,1596168000,'Building 21 - Allentown, PA','Teacher or specialist',4,5,4,4,5,5,'THE COMMUNITY HUB is going to be a great asset. ','3',3,4,5,0,0,'The conversations around creating an accelerated learning curriculum.','More discourse.',3,'The information is important to respond to the pandemic','None.',18,24,0,11,NULL,'The breakout rooms'),(14815,1596168000,'Building 21 - Allentown, PA','Teacher or specialist',4,4,5,3,4,4,'I have a better understanding of the tools that are available to me through IM and Teaching Lab. ','3',3,3,2,0,0,'I enjoyed doing the prework and knowing what we were going to be talking about. ','I wish more of my colleagues were held accountable for