ys of great value to me to get to see knowledgeable presenters and collaborate with my colleagues.','It was a fine experience but if you could help us to not have COVID-19 hanging over our heads as we go back -  that would be great. :) ',3,'It was easy to follow and very informative.','It was well run with many opportunities to learn and collaborate. ',25,15,6,13,NULL,'the breakout room discussions'),(14851,1596600000,'Fort Dodge Schools, IA','Teacher or specialist',5,4,5,5,5,5,'A better understanding of ALL Block.','3',3,5,5,5,5,'Learning how to implement ALL Block.','More modeling',3,'','',25,15,6,13,NULL,'Modeling'),(14852,1596600000,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,5,'Besides learning more about the ALL Block, the various methods we used with Moodle, Google Docs, Google Survey, and Zoom, shows that learning can be done remotely and online. ','3',3,5,5,5,5,'Although internet and technology issues are often inevitable, the entire course went well. There was a lot of learning done within a few hours. I am so appreciative for these boot camps.','NOTHING! Adrienne and Justin are the BOMB!!!',3,'Because, Adrienne and Justin are the BOMB!!!  They were very informative and we got to experience the learning. The information wasn\'t just given to us, which I appreciate.','I just want to give a shout out to Adrienne and Justin for doing a fantastic job. ',25,15,6,13,NULL,'I really enjoyed the break out rooms with experiential learning. We need more of that to help teachers, especially new ones, to understand the gist of what is expected.'),(14853,1596600000,'Fort Dodge Schools, IA','Teacher or specialist',5,5,5,5,5,5,'By providing on-line resources I can use for my own students. ','3',3,5,5,5,5,'','Nothing other than technical issues with internet connection ',3,'It was very effective, understandable, and pertainable to what is expected of us in the next couple weeks. ','THANK YOU! ',25,15,6,13,NULL,''),(14854,1596600000,'Fort Dodge Schools, IA','