er through the online information to do assignments. I think more time to go over lessons with the facilitators and then small groups by grade to get a better idea of the flow -  etc.',3,'This Bootcamp was very informative and a scaffolded training prior to using the new curriculum.','There was a lot of pertinent information in a short amount of time to help me get acclimated to the curriculum.',8,6,27,13,NULL,'Breakout groups, docs that I could print and look at, videos'),(14941,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'I feel confident to embark on the journey of the unknown so to speak because I am excited about the curriculum I am going to teach. I feel more prepared then in my previous years and know the direction I want to take for my students to engage.','3',3,5,5,5,5,'I think the discussions was successful.','Nothing -  it was great!',3,'I thought it was a great experience.','I would like to continue this work.',8,6,27,13,NULL,'I believe the combination of the zoom calls (with the breakout rooms especially) and independent Moodle assignments made it easy to complete the work.'),(14942,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'We discussed how we could implement the curriculum remotely.  Examples include using technology and Google Docs for collaboration.','3',3,5,5,5,5,'The breakout rooms with my colleagues.','Maneuvering through some of the activities on the Moodle Platform were confusing. ',3,'The facilitators were knowledgeable on the content and very friendly. ','Thank you to Ryan and Justin!  The bootcamp was worth it.',8,6,27,13,NULL,'The independent readings were enlightening. '),(14943,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'By learning more protocols and conversation cues that will encourage routines and equity in the classroom.','3',3,5,5,5,5,'The readings, the conversations both in the large group and the breakout rooms and the work.','Nothing',3,'This was well organized PD that is useful for our classrooms.','',8,27,6,13,NULL,'The Module Unpacking Protocol'),(14944,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',4,4,4,4,4,3,'','3',3,5,5,5,5,'Understanding the El curriculum','Showing what it will look like virtually.',3,'It was very thorough snd informative. ','',8,6,27,13,NULL,'all of the activities were helpful'),(14945,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,4,5,5,5,4,'','3',3,5,5,5,5,'The outline and course assignments gave me time to complete them on time.','Having the physical curriculum to look at but under the circumstances -  I understand. Also -  there was nobody on my grade that I could speak with about the modules I will be teaching.',3,'The facilitator were knowledgeable and helpful','',8,6,27,13,NULL,'The videos and PDF\'s were helpful'),(14946,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'I feel more confident in getting started with EL 2.0','3',3,5,5,5,5,'The scheduling of work ws fair and attainable','Partnerships with a grade band person or team to delve into a grade specific unit',3,'','',8,6,27,13,NULL,'The reflections after each session and the activities that were specifically tailored'),(14947,1597809600,'NYC District 11 - District-wide, NY','School-based coach',5,5,4,5,5,4,'Through collaborative talks with colleagues during the sessions ','3',3,5,5,5,5,'','',3,'','',8,28,6,13,NULL,''),(14948,1597809600,'NYC District 11 - District-wide, NY','School-based administrator or supervisor',5,5,5,4,4,5,'','3',3,5,5,5,5,'I think the way the moodle was structured in an RTTW model was helpful to see how this can be applied in a remote environment.  I liked the accountability of submitting items for feedback.  This course helped me successfully and sustainably unpack three grade levels of curriculum.','More exemplars',3,'','',8,6,27,13,NULL,'Unboxing protocol'),(14949,1597809600,'NYC District 11 - District-wide, NY','Teacher or specialist',4,5,4,5,5,4,'','3',3,5,5,5,5,'','',3,'The content of the PD was good, I had a little difficulty with the platform, locating resources and my laptop did not cooperate at times.','I enjoyed meeting and working with both Ryan and Justin and I enjoyed working with my colleagues in the break out rooms.',8,27,6,13,NULL,''),(14950,1597809600,'NYC District 11 - IS 355, NY','School-based coach',5,5,5,5,5,4,'Initially I had a hard time believing that our students are able to engage in small group discussions or be members of collaborative teams. But the activities that we engaged in via zoom and break out rooms illustrated that this is possible. Though we are adults and able to manage ourselves more than an average middle school child, the platforms are there to keep our students engaged, thinking, and sharing their theories about the texts they read. Protocols and structures are important in Covid teaching times and these were also greatly modeled for us throughout our time together. It\'s possible!','3',3,5,5,5,5,'The activities that repeatedly brought us back to do our own close reading of the texts. The questions we were asked were thoughtful and rigorous. The workshop in general utilized the same protocols and supports that we are expected to use in the EL curriculum with our students. I made many connections between the work that we did and the work our students will do. ','I think the only thing that I would try to improve is to have a folder where all the materials are rather than having to download everything then upload it back to the assignments. There is a lot of valuable -  meaningful information here that I\'d like to share with the teachers but having to download the videos and documents one by one will be time consuming for me. I want it all! ',3,'Because this was extremely informative and like I said earlier, I think that this course modeled exactly how our students should be building their own knowledge about a topic. We engaged in Text,Task,Targets,Topics using the RTTW process as well as using the protocols and supports. They did a great job of embedding the practices of EL in this course which helped me make the connections I needed to know that it is possible for our students to be challenged and engage in rigorous learning activities even in these unprecedented times. Bravo!','Justin and Ryan were patient, accommodating, knowledgeable, and made this course accessible.  They were well prepared each time and never let us get off course. ',8,6,27,13,NULL,'Application activities where, after we read, we were asked to apply that learning to some kind of reflection or summary activity. The activity in session 12 was especially rigorous and supported my learning as I was able to connect how the protocols and supports reflect RTTW. It reminded me that these are all connected and are not isolated. '),(14951,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,5,5,'I liked the layout of the course- everything was very clear (especially on a new learning platform), if you had any questions-the facilitators answered right away, and they allowed us time to collaborate with our grade bands throughout zoom meetings.','Nothing ',3,'For my first virtual PD, this PD was very informative and relevant to implement into my classroom at the start of the school year.','Thank you to the facilitators!',8,6,27,13,NULL,'I liked watching the videos of teachers putting the protocols into action. I also really liked the unboxing method for backwards design. Considering the 4T\'s in a lesson is very significant.'),(14952,1597809600,'NYC District 11 - District-wide, NY','Teacher or specialist',4,4,3,3,3,3,'Although this course was very helpful, we would need much more information and time to learn how to make this work with the new guidelines and norm.  This was in no way the fault of the presenters- they were great! ','3',3,5,5,5,5,'The videos and zoom calls for clarification.','Having all of the documents for printing located in one place on the left sidebar- some of the assignemnts were difficult to complete because of this.\nThe submission of docs on Moodle was sometimes tempermental!',3,'I felt that this was a great jump start to EL but there is STILL SO MUCH MORE TO LEARN!  It would\'ve been more beneficial to have some kind of teacher\'s guide handy or a resource manual to refer to other than having to rely on printing SO many things.','Justin and Ryan did an amazing job making everyone feel comfortable to talk and share.  They were very accomodating and provided adequate feedback on assignments.',8,6,27,13,NULL,'videos, examples of the curriculum'),(14953,1597809600,'NYC District 11 - District-wide, NY','Teacher or specialist',4,5,4,4,5,4,'This course gave me background knowledge. So once school begins, I won\'t feel or look like a deer in highlights; that I have some familiarity with the program.','3',3,5,5,5,5,'','',3,'The PD was interesting. The platform was a little difficult for me to navigate.  Also my laptop did not cooperate at times.','Both my facilitators were available to me for any off-line questions and both of them got back to me right away.',8,6,28,13,NULL,''),(14954,1597809600,'NYC District 11 - PS 87, NY','Teacher or specialist',5,5,5,5,5,4,'','3',3,5,5,5,5,'It was interactive which kept us engaged.','It was as good as it could be in a virtual setting!',3,'','',8,6,27,13,NULL,'Breakout groups, filling in organizers'),(14955,1597809600,'NYC District 11 - PS 87, NY','School-based administrator or supervisor',5,5,5,5,5,5,'This is a new curriculum for us and this course was a good beginning to get me to understand the various components of EL, digging into the modules, thinking about a vision of what I want to see in  classrooms and be able to support teachers.','3',3,5,5,5,5,'Really enjoyed the break out discussion sessions','',3,'This was a great beginning to get anyone new to the curriculum to have the basics needed to get deep into the learning','Thank You Great Bootcamp',8,6,27,13,NULL,'Learning from each other during discussion'),(14956,1597809600,'NYC District 11 - District-wide, NY','Teacher or specialist',5,5,5,5,5,5,'This course helped me become familiar with the materials and protocols to move forward for September.','3',3,5,5,5,5,'Exploring materials, having group discussions in breakout rooms and having a chance to create a vision and work at our own pace.','Seeing a lesson in action',3,'It was an engaging training that made me feel comfortable with the work ahead.','no',8,6,27,13,NULL,'Looking at engaging tects, various questions, etc.'),(14957,1597809600,'NYC District 11 - PS 87, NY','School-based administrator or supervisor',4,5,4,4,4,4,'THE EL CURRICULUM IS NEW TO MY SCHOOL. BY WALKING US THRU SOME OF THE ACTIVITIES GIVES ME AN IDEA OF HOW TEACHERS AND I CAN/SHOULD LOOK AT INSTRUCTION','3',3,5,5,0,0,'WE HAD AN OPPORTUNITY TO TRY OUT AND DISCUSS DURING BREAKOUT ROOMS','SOME MORE DEEP DIVE INTO LESSONS',3,'I NEED MORE EXAMPLES OF PLANNING, I WANTED MORE HAND HOLDING OF A LOOKING AT HOMEWORK AND DISCUSSION THE READING MATERIAL, ESPECIALLY THE FIRST SESSION\'S READING ASSIGNMENT,  I DID NOT MAKE A CONNECTION TO EL UNTIL SESSION 2, I COULD NOT KEEP UP WITH HOMEWORK DUE TO OTHER RESPONSIBIITIES','NO',8,6,0,13,NULL,'IDEAS FROM OTHER PARTICIPANTS'),(14958,1597809600,'NYC District 11 - PS 87, NY','Teacher or specialist',5,5,5,5,5,4,'I know and have the resources I need to help prepare me for school opening!','3',3,5,5,5,5,'Break out rooms, the questions asked during the zoom meeting and the videos!','More videos of teaching of EL',3,'Facilitators very knowledgeable and caring','thank you',8,6,27,13,NULL,'Videos and chats'),(14959,1597809600,'NYC District 11 - PS 89, NY','School-based administrator or supervisor',4,3,4,3,5,4,'','3',3,4,4,4,5,'User accessibility for course learning activities','More opportunities to engage with the EL curriculum for all participants',3,'I would have liked more opportunity to unpack the curriculum','',8,6,27,13,NULL,''),(14960,1597809600,'NYC District 11 - PS 87, NY','School-based coach',4,4,4,4,5,2,'As we unpacked the modules we were given time to think about how this would look through remote instruction, then we discussed it in small groups.  ','3',3,5,5,5,5,'I liked the use of the breakout rooms in the beginning that were randomized.  It forced all participants to use their video and speak up.','Time to unpack more...I also would have liked more time in walking through the EL materials during a Zoom call.',3,'It would be a great PD for all teachers in my building.  The room for growth would be for more time in looking through the materials.','',8,6,27,13,NULL,'The templates used to unpack the modules.  '),(14961,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',4,5,5,5,5,1,'','3',3,5,5,4,5,'Sense of community','Model a lesson for us please',3,'Facilitators are so nice!','Thank you!!!',8,6,27,13,NULL,'Breakout Rooms'),(14962,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,4,5,4,'Having many Kindergarten students, in which this will be their first school experience will be challenging. Once they master the laptops/tablets I feel I can engage them in learning.','3',3,5,5,5,5,'The pacing of this course was excellent. During the summer, when teachers are not instructing and planning while learning the curriculum at the same time is an ideal time to actually internalize all the information.','I was not able to register myself -  so the Assistant Principal registered me. Unfortunately -  the information given was incorrect and by the time I was able to go on the Teaching Lab many of my assignments were late. I know there was no  penalty and this was just a personal issue for me -  lol  Other than that I really enjoyed learning all that the EL Curriculum has to offer the teachers and students. Thank You!',3,'I believe there is always room for improvement. Even if you have taught the EL curriculum years before, there so much to reflect on that pertains to what our students are facing in todays world.','Not at this time.',8,6,27,13,NULL,'Justin and Ryan did an amazing job in grouping the teachers to reinforce what we read and towards the end in our grade bands to unpack the Module/Units.'),(14963,1597809600,'NYC District 11 - District-wide, NY','School-based administrator or supervisor',5,3,5,3,4,3,'Techniques to use when unpacking Grade Level Content Materials','3',3,5,5,3,4,'Asynchronous work; Break out group sessions - learning from each other','Having 2 or 3 sessions for admin separately with the three weeks',3,'You own your learning; Course is well structured for remote climate','As an admin, I find that the requirements were overwhelming but extremely useful. Because of the climate, it was a bit challenging as I\'m also supporting my principal with the re-opening process. All in all, assignments scheduled were quite appropriate to fully understand the curriculum. ',8,6,27,13,NULL,'Unit Boxing; Elevator Pitch'),(14964,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'I\'ve learned about the way each module is set up and how they each build on one another','3',3,5,5,5,5,'I enjoyed the discussing and break out rooms','n/a',3,'the facilitators made this pd very engaging','n/a',8,6,27,13,NULL,'breakout rooms '),(14965,1597809600,'NYC District 11 - District-wide, NY','School-based coach',5,5,5,5,4,5,'It helped me prioritize how to plan and internalize lessons with appropriate scaffolds and supports for students that can be used virtually or in person.','3',3,5,5,5,5,'The materials/resources and readings','More time to complete independent work',3,'The abundance of information, the plethora of materials, and resources','',8,6,27,13,NULL,'The videos and materials/resources'),(14966,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,4,4,4,5,3,'It showed me the supports that are implemented and made me think about how these will transfer','3',3,5,5,5,5,'the explaining of the structures and practices','i would have liked to be able to look more at actual materials and lesson plans with my team',3,'my instructors were awesome!','Thank you Justin and Ryan! You guys were amazing 😊',8,6,27,13,NULL,'going through modules with grade teams'),(14967,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,4,'','3',3,5,5,5,5,'Overall, the course was well-organized with plenty of information presented by helpful facilitators.','Focusing on a breakdown of one lesson -  especially a virtual lesson.',3,'This bootcamp was very informative.','',8,6,27,13,NULL,'The Zoom calls, breakout rooms'),(14968,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,4,5,5,3,'','3',3,5,5,5,5,'Breakout Rooms','',3,'Helpful in unpacking the curriculum ','',8,6,27,13,NULL,''),(14969,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'I feel like I know the material better and I will be able to implement it remotely.','3',3,5,5,5,5,'I liked how they set up the overall course materials','Nothing it was great!',3,'I think the EL Bootcamp was very helpful.','',8,6,6,13,NULL,'The Breakout Rooms when we met with our teacher teams'),(14970,1597809600,'NYC District 11 - District-wide, NY','Teacher or specialist',5,5,4,4,5,3,'','3',3,4,5,5,4,'Considering that this course was done online, I was able to follow the facilitators and have discussions with my colleagues.','If the course was done in person -  my experience would have been improved.',3,'I think that the facilitators did a great job in teaching about the EL curriculum.','',8,27,6,13,NULL,'Collaborating with my colleagues afforded me the opportunity to learn about their experiences and the EL curriculum.'),(14971,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'I am ready to unpack EL 2.0 and use it in my classroom','3',3,5,5,5,5,'the coursework went better