lear, can work at my own pace','Sometimes it was hard to know what was due when',3,'','',8,6,27,13,NULL,'The reflection posts'),(14977,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',4,4,4,5,5,3,'It has provided me an overview on how the lessons are developed and how to drive instruction.','3',3,5,5,5,5,'The way it was presented','Maybe having time to look at one lesson and plan',3,'It was organized and informative','',8,27,6,13,NULL,'Boxing Activity '),(14978,1597809600,'NYC District 11 - PS 89, NY','Teacher or specialist',4,5,4,5,5,4,'','3',3,5,5,5,5,'familiarizing myself with the resources','',3,'Provided a great deal of insight to the program','',8,6,6,13,NULL,'breakout rooms'),(14979,1597982400,'NYC District 11 - PS 89, NY','consultant',3,3,2,2,3,1,'','3',3,5,5,5,5,'access to info','more time devoted to working with teachers through a unit module or lesson',3,'I would have liked to done more in depth planning with teachers','',8,6,27,13,NULL,'reading through module on my own time'),(14980,1599019200,'NYC District 11 - District-wide, NY','School-based coach',5,5,5,5,5,4,'','3',3,5,5,5,5,'The Synchronous work together gave us time to share ideas and learn from one another','More time to unpack curriculum ',3,'It was very good. I would like another week to unpack curriculum ','',8,9,27,13,NULL,'The synchronous work gave me time to reread and process the activity and curriculum '),(14981,1599019200,'NYC District 11 - PS 89, NY','Teacher or specialist',4,3,4,4,5,3,'','3',3,5,5,5,5,'The facilitators were kind, flexible, and delivered material in an organized, and supportive manner.','Being able to directly apply a curriculum to my grade level. (PK)',3,'I enjoyed learning about this EL curriculum. I would recommend it to a teacher working in grades K and up.','',8,9,27,13,NULL,'Independent work.'),(14982,1599019200,'NYC District 11 - PS 498, NY','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'Much deeper understand