r my grade levels were most helpful.'),(14987,1599019200,'NYC District 11 - PS 498, NY','Teacher or specialist',5,5,5,5,5,5,'It helped me learn how to find all the resources to better support my students. ','3',3,5,5,5,5,'Group discussions','Looking through 1 lesson and seeing how it was planned and taught. ',3,'I thought the facilitators were very enthusiastic and knowledgable. ','It was a wonderful learning experience. ',8,27,9,13,NULL,'Reflections that everyone can read and respond too. '),(14988,1599019200,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,5,5,'it was intentional and engaging. I enjoyed the discussions with the other participants. ','n/a',3,'it was engaging and very resourceful .','na/',8,9,27,13,NULL,'The breakout rooms. '),(14989,1599019200,'NYC District 11 - PS 498, NY','School-based administrator or supervisor',5,5,5,5,5,4,'I would have like to plan out a few lesson- to show teachers and if any lessons could be taken out and why?  I am just concern about pacing.  It was discussed that it should be done with fidelity but not all module will be done this year and that was ok.  I want to make sure major standards are addressed. Maybe this is something we could check in with you guys as we go on. ','3',3,5,5,5,5,'The independent work assisted in understanding the curriculum ','planning a lesson - unit',3,'The meeting and workload assisted in understanding the EL curriculum  ','no',8,9,27,13,NULL,'all of it bc EL is all new to me'),(14990,1599019200,'NYC District 11 - PS 498, NY','Teacher or specialist',5,5,5,5,5,5,'I am able to understand the ideas behind the curriculum and ','3',3,5,5,5,5,'pacing and materials, live instruction and break out groups','nothing',3,'I feel much more comfortable and excited about teaching and using this curriculum ','Mindi and Ryan were amazing! ',8,9,27,13,NULL,'discussion questions '),(14991,1599019200,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,3,'Provided a clear understanding of EL','3',3,5,5,5,5,'','',3,'','',8,9,27,13,NULL,''),(14992,1599019200,'NYC District 11 - PS 89, NY','School-based coach',5,5,4,5,4,3,'given the resources ','3',3,4,4,4,4,'','',3,'I just feel that the corse that I took practices what they preach when it come to what they are teaching and believing in ','thank you!',8,9,27,13,NULL,''),(14993,1599019200,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,4,'I\'ve learned how to navigate through the EL resources.','3',3,5,5,5,5,'It gave me a deeper understanding of the EL curriculum and made me feel more confident about implementing it this school year.','Some of the work that was done independently would have been better in a zoom call.',3,'This course helped me become more familiar with the EL curriculum.','',8,9,27,13,NULL,'Zoom calls - we were able to get better explanations about the material that was being taught to us.'),(14994,1599019200,'NYC District 11 - PS 89, NY','Teacher or specialist',3,3,3,4,3,1,'','3',3,4,4,4,4,'Understanding how the curriculum is cohesive.','Receiving this help while I was teaching for it to be more meaningful.',3,'It was helpful and well planned.','',8,27,9,13,NULL,'All'),(14995,1599019200,'NYC District 11 - PS 89, NY','Teacher or specialist',3,3,3,3,4,2,'The opening gifs were a model of how to engage students virtually.','3',3,4,4,4,4,'','',3,'I feel that the course prepared me to access the curriculum and increased the buy-in for educators.','No',8,9,27,13,NULL,''),(14996,1599019200,'NYC District 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,5,'It helped me to understand the basis of the curriculum therefore allowing me to think how I may modify to meet remote needs','3',3,5,5,5,5,'Working together on the Zoom calls','More work on the modules',3,'Great information','Thank you',8,9,27,13,NULL,'Unpacking the modules'),(14997,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',5,5,5,5,5,5,'I\'m not sure if this question is asking about school opening \"during COVID-19,\" as we are still in the midst of the pandemic OR school opening after COVID-19 as in after the pandemic has past and we can return to \"normalcy,\" but I will respond to both.  When asked about small group instruction and collaborative groups, we were told to focus on the goals and learning targets of each lesson, each unit and each module.  What is the overarching goal?  What do we want our students to get out of this time spent collaborating and learning from one another.  I think that was a good response to a difficult question, but as educators, we are still trying to think about protocols in what may just be whole group discussions as we are practicing social distancing in our classrooms.  So, our vision of what EL looks like, sounds like and feels like is much different from what it will actually be when we are engaged in in-person learning starting on September 21st.  As far as literally \"after COVID-19,\" when we can engage in small group, collaborative discussions and in work that requires us to physically be closer together:  YES, I feel as though this course has helped me to prepare.  I can envision this setting.  I can see what it looks like, sounds like and feels like.  Will I be able to implement this in a few weeks?  I strongly doubt that, but as the months pass by, I hope that this vision will be possible.','3',3,5,5,5,5,'I like the way we delved into activities that the students would be engaged in.  It really provided perspective as we worked through activities and collaborated with participants.  We learned through doing.','Given the fact that this was a three week summer bootcamp -  I wasn\'t expecting much feedback from the facilitators -  but it would have been nice to receive individualized comments related to some of the responses and work that was submitted.',3,'The course work was organized effectively.  I feel like I engaged in work that will help me unpack the curriculum with confidence.  I am excited to engage in this work, planning for differentiation and preparing for individual learners.  I think when engaging with a new curriculum, the work ahead seems arduous and not exciting, but it definitely DOES NOT feel that way with the EL curriculum.  I am excited to plan and I\'m looking forward to engaging in the teaching and learning that will occur in my classroom.','',8,9,27,13,NULL,'The first Zoom meeting really stands out in my mind as we engaged in a deep dive close read of several different texts.  We compared text-to-text, text-to-self and text-to-world questioning to questions that lent themselves to deeper analysis and discussion.  Participants were able to see how questioning really propelled discussions to be deeper, more meaningful and to truly engage students in lasting learning.\n\nThe reflections in most sessions really helped us to review what we have learned, to make connections and to solidify that learning.'),(14998,1599019200,'NYC District 11 - PS 89, NY','Teacher or specialist',4,5,5,5,5,3,'More information on how to implement this program virtually, more interactive online resources to provide for students and parents ','3',3,5,5,5,5,'online work, discussions during zoom meetings','more information on how to implement this curriculum virtually. many activities are hands on which is amazing for special education -  but if we are finding ourselves fully remote -  this may be difficult to implement at its fullest potential. ',3,'I learned so much about this curriculum and the thought/science behind it which will make me a more effective teacher. It helps me believe in what I am teaching knowing that there has been previous success and that my students will benefit.','n/a',8,9,27,13,NULL,'break out rooms with my grade level team'),(14999,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',3,3,3,4,4,2,'','3',3,5,4,5,4,'','',3,'I think it was definitely beneficial, but I would have liked more hands-on time accessing the materials and navigating through the teacher materials. k ','',8,9,27,13,NULL,''),(15000,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',4,5,4,5,5,4,'It helped me to unpack the material and make decisions on remotely sharing the curriculum wit my diverse group of students. ','3',3,4,4,4,4,'I liked the various components, working and learning from others in the Break out groups.','More in-depth planning using materials.',3,'Pacing the tasks and more time for diving deeper into planning a Module or Unit with Backward design and using materials.','It was very informative and organized.',8,9,28,13,NULL,'Sharing ideas with grade level teachers and looking at a Unit.'),(15001,1599019200,'NYC District 11 - District-wide, NY','School-based coach',5,5,5,5,5,5,'Gave me an overview of the curriculum.','3',3,5,5,5,5,'Unpacking the curriculum','More unpacking and diving into lessons',3,'Gave me a good overview.','',8,9,27,13,NULL,'Unpacking  and having the group discussions about the curriculum'),(15002,1599019200,'NYC District 11 - District-wide, NY','School-based coach',4,4,4,4,5,3,'It gives me hope that once everything settles down, this program will help us heal.','3',3,5,5,5,5,'I felt that it followed naturally and that each session built on the previous one.','My technological meltdowns detract from my experiences. i.e. I must have made a mistake. I guess Mandi was the only facilitator. I couldn\'t find Ryan\'s name who was excellent also. These type of issues upset me. It gives me insight as to how a student must feel who struggles.',3,'I was up for the experience. I thought it was well worth my time and effort. I\'m never sure if the next pereson would be as receptive so that prevents me from choosing a 10.','I worked all summer to learn the ins and outs of the program and this class made it come alive. It is also frustrating that I will not be developing this with the K-4 staff but will actually return to 20 years ago by teaching grade 7. I wonder if I should try to institute this on my own.',8,9,27,13,NULL,'I enjoyed looking at the lessons in depth and relating them to the goals of the course.'),(15003,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',4,5,4,3,4,3,'The FLEX curriculum looks like it has great potential as a resource for remote, but we did not spend much time looking into it or how to navigate through it.','3',3,5,4,5,4,'The beginning introductions to the curriculum and getting to know the in\'s and out\'s of how the curriculum is shaped.','Week two we spent a lot of time doing independent work -  which began to get a bit repetitive in nature.  The our Zoom call at the end of the week was reviewing what we had done on our own ~ too much redundancy ~ we could of moved onto the next part together -  creating more time to look at an actual lesson in action and discussing together -  as well as time to look at the remote options.',3,'Much of it can be done independently.  It is a good motivator if you are not a self-directed and self motivated learner.','It was a great way to learn about a new Curriculum that I had little prior knowledge of.  Still feel a bit out in left field about implementing on my own.  But, this may require actually putting it to use before any level of comfort can be felt.',8,9,27,13,NULL,'Videos with reflecting questions or postings to share thoughts about new information.'),(15004,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',5,5,5,5,5,4,'We discussed how we may use the HHH protocols to address the current climate of the world and what we are facing and also discussed how we could possibly adjust the curriculum for our return to in-person learning.','3',3,5,5,5,5,'the collaborative discussions with other professionals on the zoom calls.','',3,'I thoroughly learned so much during this whole process.','Thank you Ryan and Mandi!',8,9,27,13,NULL,'the reflections and activities within moodle'),(15005,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',5,4,5,5,5,3,'I was hoping for more remote teaching materials access to curriculum','3',3,5,5,5,5,'','',3,'we are in the second year of EL','no',8,9,27,13,NULL,''),(15006,1599019200,'NYC District 11 - District-wide, NY','School-based coach',5,5,4,5,5,4,'A few suggestions were made to help prepare us for implementing the curriculum successfully in a blended learning environment.  ','3',3,5,5,0,0,'The course was well organized. The facilitators were knowledgeable, personable, and professional.  ','N/A',3,'The boot camp was informative and meaningful.  I have a greater understanding of EL education and will apply my learning to my practice.  ','',8,9,0,13,NULL,'Collaborating with colleagues in the breakout rooms was a great way to support my learning.'),(15007,1599019200,'NYC District 11 - PS 89, NY','Teacher or specialist',4,4,4,5,4,4,'','3',3,4,4,4,4,'navigating curriculum','',3,'','',8,9,27,13,NULL,'unpacking curruculum'),(15008,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',4,4,4,4,5,3,'','3',3,5,5,5,5,'','',3,'Not enough information for teachers who are working remotely','i think more information on how the program can be used remotely would be a great help',8,9,27,13,NULL,''),(15009,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',5,3,5,5,3,4,'Ready to build a positive classroom culture','3',3,5,5,5,5,'the materials and opportunities to talk with colleagues','less condensed timeframe and not right before school starts',3,'they may have another literacy program required','beneficial even though I will not be teaching literacy',8,9,27,13,NULL,'the videos'),(15010,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',4,4,4,5,5,3,'','3',3,5,5,5,5,'the interaction and sharing of idea with different colleagues. Found the break out rooms to be very helpful.','I enjoyed the synchronous learning . so more synchronous sessions.',3,'I found this boot camp to be very thorough and helpful','',8,27,9,13,NULL,'break out rooms'),(15011,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',5,5,4,5,5,4,'','3',3,5,5,5,5,'zoom calls','moodle is a difficult platform to navigate',3,'the facilitators were informative','',8,9,27,13,NULL,'collaborating in breakout rooms'),(15012,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',5,5,5,5,5,3,'','3',3,5,5,5,5,'','',3,'','',8,9,27,13,NULL,''),(15013,1599019200,'NYC District 11 - District-wide, NY','Teacher or specialist',5,5,5,5,5,3,'I learned the vision and frameworks of EL','3',3,5,5,4,5,'collaborating with other educators','I would have liked to see the actual layouts of lessons and how they are presented.',3,'I needed more support with seeing the actual program and the different sections modeled','',8,9,27,13,NULL,'working in break out rooms'),(15014,1599019200,'NYC District 11 - District-wide, NY','School-based administrator or supervisor',5,4,5,5,4,3,'Resources that were provided such as scaffolds and strategies.','3',3,5,5,5,5,'The resources, the videos and the articles','To have completed this boot camp in July so that I could have put a team together and plan the roll out without feeling rushed',3,'It was rigorous, informative, and I am sold on EL!!!','',8,9,27,13,NULL,'The reflections, and the one pagers helped with assignments'),(15015,1599019200,'NYC District 11 - District-wide, NY','School-based administrator or supervisor',5,4,5,5,4,3,'resources','3',3,5,5,4,4,'The resources , articles , videos and the meetings','Wish it was earlier in the summer to allow time to plan in August.',3,'For all the reasons mentioned above','thank you',8,9,27,13,NULL,'Sharing the reflections with the community and reading them'),(15016,1599019200,'NYC District 11 - PS 498, NY','School-based administrator or supervisor',5,5,5,5,5,5,'Yes, the two facilitators modeled BEST PRACTICES for Zoom Meetings and balancing whole school and small group learning.','3',3,5,5,5,