ict 11 - PS 89, NY','Teacher or specialist',5,5,5,5,5,2,'I am concerned about using this program during remote learning.  I don\'t feel these sessions have helped me with teaching online.','3',3,5,5,5,5,'Break out rooms went well and the structure of navigating the curriculum. ','Due to the times I think a piece needs to be added on remote teaching with this curriculum.',3,'In the end I do feel more comfortable about what I am teaching, so they did a good job!','',8,9,27,13,NULL,'Navigating different parts of the curriculum. I feel like I understand how it works and what I am teaching.'),(15042,1599105600,'NYC District 11 - PS 189, NY','Teacher or specialist',4,5,4,4,5,1,'Boot camp with the remote materials not the traditional ','3',3,5,5,5,5,'break out rooms','more time with the looking at the specifics of the curriculum on my grade level',3,'it was good for overall but could be improved with more specifics','no',8,1,21,13,NULL,'looking at the curriculum'),(15043,1599105600,'NYC District 11 - PS 189, NY','Teacher or specialist',4,3,4,4,4,4,'The overview and resources were helpful. I am still reviewing them since I am new to the curriculum','3',3,5,4,5,5,'Digging deeper into the curriculum','Considering the times we are in -  I would have liked to work with the curriculum a bit more',3,'This is excellent for those who are new to the curriculum but for those who have worked with it digging deeper into the curriculum would have been more beneficial','',8,1,21,13,NULL,'Watching the videos and using the resources'),(15044,1599105600,'NYC District 11 - PS 189, NY','Teacher or specialist',1,2,1,1,4,1,'This course was not appropriate for our current situation. At any other time I would have enjoyed this course, however at this moment I need support in preparing for this strange new way of schooling and I do not feel we were offered that. The main facilitator of the course claimed to understand where we are right now, but any time any of us expressed what we actually need support with she seemed unwilling to change course.','3',3,2,2,2,2,'We were given a couple of opportunities to interact with the EL curricular resources.','If the course was actually about the EL curriculum. It was more focused on professional learning. This would be great any other time -  but during a pandemic we need SUPPORT with the curriculum.',3,'I did not feel that it met my needs at this moment','',8,1,21,13,NULL,'Being able to see the resources we will be using.'),(15045,1599105600,'NYC District 11 - PS 189, NY','School-based coach',3,4,4,3,4,3,'','3',3,4,4,4,4,'The opportunities to navigate the modules and lessons and assessments.','Getting into the curriculum itself sooner in the course.',3,'Some colleagues felt they would have liked more specific direction on the curriculum itself.','',8,1,21,13,NULL,'Reflecting on the assessments and what is necessary for students to know to achieve success.'),(15046,1599105600,'NYC District 11 - PS 189, NY','Teacher or specialist',5,5,5,5,5,4,'Breakout sessions on remote learning','3',3,5,5,0,0,'Looking at the overview of the modules and then each component specifically','More resources for online component',3,'Great bootcamp for getting to know the program','',8,1,0,13,NULL,'Looking at the differentiated activities to support all learners'),(15047,1599105600,'NYC District 11 - PS 189, NY','Teacher or specialist',4,4,5,5,5,3,'The resources were great tools to help start the school year','3',3,5,5,5,5,'','More info on how to teach EL in a remote setting',3,'This is a great training for anyone unfamiliar with EL or with teaching lab practices. For those who are already experienced in these, this learning is redundant. ','',8,1,21,13,NULL,''),(15048,1599105600,'NYC District 11 - PS 189, NY','Teacher or specialist',2,4,2,2,4,1,'','3',3,3,3,3,3,'','actually diving more into the curriculum and implementing it remotely due to COVID',3,'','',8,1,21,13,NULL,'the unpacking of a module'),(15049,1599105600,'NYC District 11 - PS 89, NY','Teacher or specialist',4,4,4,4,5,4,'it helped me dive deeper into this curriculum to understand why it was built and how to best implement it. ','3',3,5,5,5,5,'The break out rooms','more videos -  less reading. ',3,'It was very helpful, it made me feel more comfortable with teaching this curriculum. ','thank you! ',8,9,27,13,NULL,'the scaffolds lesson, and the vision and goal setting activity. '),(15050,1599796800,'Legacy Early College, SC','Teacher or specialist',3,3,3,3,3,1,'','3',3,3,4,0,0,'','',3,'','',8,1,0,13,NULL,''),(15051,1599796800,'Legacy Early College, SC','Teacher or specialist',2,2,4,3,2,1,'I would have loved to have recoeved more resources for teaching online. ','3',3,4,4,4,4,'','Providing us with material that we weren\'t familiar with . A lot of this information we already knew about or how to do . ',3,'I didn\'t learn anything new . ','',8,26,1,13,NULL,''),(15052,1599796800,'Legacy Early College, SC','Teacher or specialist',1,1,1,1,1,1,'I did not. ','3',3,5,5,0,0,'','',3,'','',8,1,0,13,NULL,''),(15053,1599796800,'Legacy Early College, SC','Teacher or specialist',2,1,2,2,5,1,'It was relevant for my grade level.  I also did not learn any strategies to help teach the curriculum virtually.','3',3,5,5,0,0,'Teachers were able to vent.  However we feel behind on work.','More help on teaching the content virtually.',3,'I didn\'t learn how to teach the content virtually.','',8,26,0,13,NULL,''),(15054,1599796800,'Legacy Early College, SC','Teacher or specialist',3,4,4,3,3,4,'It has helped me become more familiar with EL','3',3,3,4,3,4,'The facilitators were personable and interested in their role and helping learners\n','More relevant to my grade level',3,'Although material is important it was general information','I wish it had started earlier in the summer.',8,1,26,13,NULL,'Homework'),(15055,1599796800,'Legacy Early College, SC','Teacher or specialist',4,4,4,4,4,2,'','3',3,5,5,4,5,'','',3,'','',8,1,26,13,NULL,''),(15056,1599796800,'Legacy Early College, SC','Teacher or specialist',1,2,2,2,2,1,'I didn\'t feel like this course did anything to help with virtually teaching EL. This seemed like an overview of EL altogether, and having taught EL before, the information provided wasn\'t new or helpful.','3',3,3,3,3,3,'I didn\'t get any new or helpful information from this course. ','Information on using EL virtually would have been helpful at improving my experience. ',3,'The course wasn\'t helpful for virtual teaching. ','',8,1,26,13,NULL,'Collaborating with team members'),(15057,1599796800,'Legacy Early College, SC','Teacher or specialist',3,3,3,3,3,3,'','3',3,4,4,4,4,'','',3,'','',8,1,26,13,NULL,''),(15058,1599796800,'Legacy Early College, SC','Teacher or specialist',3,4,3,2,4,2,'','3',3,4,4,3,3,'','As a returning teacher -  I feel there were a lot of things that were not addressed in this course. I feel we should be provided information to continue assisting us grow -  but the information was repetitive of previous training. The course was a repeat of information we already knew and did not challenge us to grow.\n\nAlso -  we were not provided information on how to address the COVID crisis in our teaching virtually. ',3,'It is a very general training I would not recommend for returning teachers.','',8,20,26,13,NULL,'Team time to talk'),(15059,1599796800,'Legacy Early College, SC','School-based coach',2,4,3,2,3,2,'','3',3,4,2,4,2,'','Most of the staff felt like we were going over things we already knew.  We also thought that there would be more time spent helping us understand how to teach the curriculum virtually.  ',3,'I do not feel that our PD money nor time was spent most effectively.','',8,1,26,13,NULL,''),(15060,1599796800,'Legacy Early College, SC','Teacher or specialist',2,3,3,3,5,1,'','3',3,5,5,5,4,'The breakout rooms to talk with our grade levels about unpacking the course materials went well. ','If we could have done more diving into the curriculum -  that would have helped tremendously. ',3,'I chose this rating because I felt like we learned more of the background of EL rather than really digging into how to teach it to our scholars especially in a distant learning environment. ','',8,20,26,13,NULL,'The activities involving referring to the materials and content of the curriculum best supported my learning. '),(15061,1604379600,'NYC District 11 - District-wide, NY','Teacher or specialist',3,3,3,3,3,3,'Discussions with peers to get different ideas about remote ideas and strategies to support the kids bout re','3',3,3,3,3,3,'','',3,'','',8,17,1,13,NULL,''),(15062,1604379600,'OTHER','Teacher or specialist',3,3,3,4,3,3,'','3',3,4,4,4,4,'Understanding where to find things with in the teachers guide book and understanding the idea of using more complex text to build comprhension.','I would like to see more teaching lessons within our own grade level bands.  Was overwhelming to watch older grades  lesson and learning without seeing it on our own grade level.',3,'','',8,18,1,13,NULL,'break out rooms'),(15063,1604379600,'NYC District 11 - District-wide, NY','Teacher or specialist',4,4,3,4,4,4,'Connection, even though we are not in person','3',3,5,5,5,5,'Introduced the many resources','Plan a full lesson with a breakout group.',3,'It was a good PD, but a lot of personal time is needed','',8,17,1,13,NULL,''),(15064,1604379600,'OTHER','Teacher or specialist',5,5,3,5,5,5,'support and understanding of the challenges we are all facing right now. ','3',3,5,5,0,0,'she allowed us to share many times in groups ','more examples on how we could implement within our grade ',3,'','',8,1,0,13,NULL,''),(15065,1595995200,'DeSoto Parish, LA','Teacher or specialist',4,4,4,4,4,4,'','3',3,4,4,4,4,'','',3,'','',15,30,10,13,NULL,''),(15066,1595995200,'DeSoto Parish, LA','Teacher or specialist',4,4,3,4,5,3,'It gave me ideas for how to conduct the benchmarks and how to teach lessons virtually.','3',3,4,4,5,5,'The interaction among the participants.','More activities that were aligned to the distri