 I actually learned how to TEACH this in my classroom.  ',15,18,17,13,NULL,'Zoom calls where we say lessons/assessments in action.'),(15104,1601524800,'Robinhood Schools (NYC), NY','Teacher or specialist',3,3,3,3,3,3,'','3',3,3,3,0,0,'','',3,'','',15,17,0,13,NULL,''),(15105,1601524800,'Robinhood Schools (NYC), NY','Teacher or specialist',4,5,3,4,4,3,'The flex curriculum helped me plan out how to break up the lesson for the time that I see my students remotely (live teaching isn\'t as long as in person).','3',3,5,5,5,5,'','The teaching lab website was often difficult to navigate. I had a hard time finding the assignments due and completing them.',3,'','',15,18,17,13,NULL,''),(15106,1601524800,'Robinhood Schools (NYC), NY','Teacher or specialist',4,4,4,4,4,3,'','3',3,5,5,5,5,'Learning how the program works.','Having more time -  having a teachers manual -  creating centers.',3,'The course was well designed, but i needed more time to devote to it.','I appreciate the dedication of Brad and Liza!',15,17,18,13,NULL,'Finding resources on the platform.'),(15107,1602129600,'NYC District 11 - District-wide, NY','Teacher or specialist',4,4,3,4,4,4,'','3',3,4,4,4,4,'','',3,'','',15,18,17,13,NULL,''),(15108,1607490000,'West Contra Costa USD, CA','Teacher or specialist',4,5,4,4,5,3,'','3',3,4,4,4,4,'I valued having the time to become familiar with the kindergarten materials.','Last assessment video needs to be redone.  I did not agree with the tester starting with the advanced words with the student and eventually going down the list of words to the easiest.  She should have started out with the more simple words to build the child\'s confidence.',3,'I feel the facilitators were knowledgeable. Skills Block is the only content area that has not been presented by EL.  Glad that they responded to the request.','Keep revising and updating!',15,30,6,13,NULL,'Videos and readings'),(15109,1607490000,'West Contra Costa USD, CA','Teacher or specialist',3,4,4,3,2,3,'','3',3,5,2,5,2,'The model of the lesson done by the facilitator was such a great example to see how to implement in the virtual space.','I felt like we were treated like a classroom instead of educators. I think there were facilitation moves that weren\'t necessary to get the information across to us.  Some examples are share outs to whole group after working in breakout rooms (nobody wants to do that) and pulling cards to speak.',3,'It\'s challenging to put the effort into the Moodle work when swamped with teaching. ','I appreciate the asynch work and all of the resources! I will go back and log-in to find resources in future!',15,30,6,13,NULL,'Getting practice to try an assessment on one of my students to walkthrough the process. '),(15110,1607490000,'West Contra Costa USD, CA','Teacher or specialist',5,5,5,5,5,5,'Sharing resources with other educators and learning about how to prioritize the tools in our curriculum','3',3,5,5,5,5,'Everything to be honest! I\'m a first year teacher this really helped me understand and use the curriculum!','more breakout rooms by school site (these were SO productive) or even a choice for how we would be split into breakouts ',3,'This PD transformed my understanding of the curriculum and gave me resources and a community to discuss practical applications with','',15,30,6,13,NULL,'the connections between the synchronous and asynchronous sessions. Loved the assessment day where we applied the learning to a scenario and used the assessment tools to evaluate a students results'),(15111,1607490000,'West Contra Costa USD, CA','Teacher or specialist',4,5,5,5,5,4,'The breakout rooms, the sample student, the use of the conversion table was great.','3',3,5,5,5,5,'The breakout rooms. the demonstrations were great. ','More practice with the conversion table.',3,'The reading demonstrations were great. ','no',15,30,6,13,NULL,'The demos'),(15112,1607490000,'West Contra Costa USD, CA','Teacher or specialist',3,4,4,3,2,3,'Felt burnt out, the timing of the PD was hard ',