nt','',11,8,0,15,NULL,'The IPG guide and using it'),(15272,1603944000,'Mississippi Department of Education, MS','Lead Teacher interventionist ',4,4,4,4,4,4,'N/A','3',3,4,4,4,3,'All','N/A',3,'I’ve enjoyed each session. ','N/A',11,7,19,15,NULL,'All. I like the different connections being made by teachers and teacher leaders. '),(15273,1603944000,'Mississippi Department of Education, MS','Lead Teacher interventionist ',4,4,4,4,4,4,'N/A','3',3,4,4,4,3,'All','N/A',3,'I’ve enjoyed each session. ','N/A',11,7,19,15,NULL,'All. I like the different connections being made by teachers and teacher leaders. '),(15274,1605675600,'Tangipahoa Parish, LA','Teacher or specialist',2,4,3,3,5,3,'','3',3,3,5,3,5,'The participants shared thoughtful feedback, but overall the facilitator talked too much and it was just SO REPETITIVE! An hour would have been enough time to talk about all of that.','Everyone is very nice -  but the content is repetitive. I feel like our students need to learn more than just reading and analyzing. This curriculum is outdated. We have students entering college and the work force and all they know how to do is annotate a text -  form a literary claim -  and prove their claim with evidence from the text. Does that make sense? They don\'t know how to write professionally and they don\'t know how to succeed in life.',3,'This entire thing is a huge slap in the face for educators. I hate to be so negative, but we are already implementing these skills in our classes. However, this curriculum is EXTREMELY boring. I am bored to death; I can only imagine how the students feel. Our students are also not able to do this work virtually from home.\n\nAs for the bootcamp itself, it is extremely long, boring, and repetitive. I feel like the instructors are just reading off of a generic script. None of this is making us a better teacher! We are exhausted and being pulled in a million different directions. I feel like there\'s so many other things that we could be spending our time on.','',35,1,2,15,NULL,''),(15275,1604984400,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,3,'','3',3,5,5,0,0,'I always have enjoyed going into our breakout rooms to collaborate with colleagues.','',3,'Great facilitators and relevant content.','',5,8,0,15,NULL,'The labeling of text dependent vs. not text dependent questions.'),(15276,1604984400,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,4,'','3',3,5,5,0,0,'The breakout rooms, after having independent time to work , were helpful.  Discussing everyone\'s experiences is great!','',3,'The specific texts and sample TDQs are enlightening!','',5,8,0,15,NULL,'Indep/collaboration'),(15277,1604984400,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,3,'','3',3,5,5,0,0,'The ability to collaborate with others was awesome!!!  The shared resources will be used and provided much support.','',3,'This session really made you think and reflect as an educator.  It is inspiring to do better!','',5,8,0,15,NULL,'It was overall amazing!'),(15278,1604984400,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,3,'','3',3,5,5,0,0,'Collaboration with groups- time to discuss and share- great resources','Nothing:)',3,'All relevant and necessary!','Thank you for all the work-- I am excited to use it.',5,8,0,15,NULL,'Comparison of TDQ and creating TDQ for a specific text with a discussion following'),(15279,1604984400,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',4,4,4,4,4,4,'','3',3,4,4,0,0,'collaboration and working on TDQ','NA',3,'Great information and resources','',5,8,0,15,NULL,'TDQ'),(15280,1604984400,'Delaware Department of Education, DE','School-based coach',4,3,4,4,4,4,'','3',3,0,0,0,0,'Morning activities. ','',3,'','',5,0,0,15,NULL,''),(15281,1606885200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,1,'','3',3,5,5,0,0,'I appreciate the flow of the day; the opportunities for break-out groups, discussion, independent work and processing as well as the information being presented in different formats.','Due to the current circumstances in our district -  I am unable to apply a lot of the great information at this current time. I would love the opportunity to discuss strategies that districts are using during virtual/hybrid learning to promote reading and writing and share successes.',3,'Today\'s session was very applicable to writing (in normal circumstances) and meeting the demands of the standards. The intentionality in the day\'s design made the information easy to digest and connect to.','',36,8,0,15,NULL,'The writing experiential and the asynchronous work prior to lunch'),(15282,1606885200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'','3',3,5,5,0,0,'The activities and breakout groups were very beneficial.   I love working and learning from my colleagues from around the state.','Not a thing.',3,'I feel that I am leaving with new knowledge as well as confirmation of previous knowledge.','Thank you for a wonderful session.',36,8,0,15,NULL,'Everything was perfect!'),(15283,1606885200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,4,'','3',3,5,5,0,0,'Everything! It was very informative and helpful.','In person learning instead of Zoom -  but this was very well done and I am not complaining!',3,'This learning is practical and useful.','Thank you!',36,8,0,15,NULL,'Collaborating with others was very helpful.'),(15284,1606885200,'Delaware Department of Education, DE','Teacher or specialist',5,4,5,5,5,3,'','3',3,5,5,0,0,'The breakout rooms and collaboration.','',3,'','',36,8,0,15,NULL,''),(15285,1606885200,'Delaware Department of Education, DE','School-based coach',4,4,5,4,4,3,'','3',3,4,4,0,0,'Learning that writing is still a key concept that needs more in depth attention and instruction.','',3,'','',36,8,0,15,NULL,'Using the matrix to validate all elements of writing as far as students and teacher!'),(15286,1606885200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'','3',3,5,5,0,0,'I really liked all of the resources and time to talk with colleagues.','Cut the some of the tasks down to accommodate the time- I would rather be asked to do less and do it well:)',3,'Great resources and process for us','Thank you for putting this together- It will be very useful!',36,8,0,15,NULL,'Reflections on the videos and articles-- also the experiential was effective'),(15287,1606885200,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,4,'','3',3,5,5,0,0,'The experiential writing activity was truly eye opening.  Being able to deconstruct that with colleagues to clarify understanding.','',3,'There is so much valuable resources and tools that I wish my ELA teachers could have joined with me today.','',36,8,0,15,NULL,'All of the activities contributed to my more thorough understanding of writing planning and instruction.'),(15288,1606885200,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,5,'','3',3,4,4,0,0,'Breakouts and links too material.  Good discussions.','',3,'','',36,8,0,15,NULL,'The reading materials/videos and discussions.  I liked the articles.'),(15289,1606885200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'','3',3,5,5,0,0,'Collaborating with colleagues','',3,'','',36,8,0,15,NULL,''),(15290,1598587200,'Legacy Early College, SC','School-based coach',4,5,3,3,5,4,'Helped me think about what standards to focus on while teaching through a pandemic.','3',3,4,5,5,5,'','',3,'','',20,22,25,16,NULL,''),(15291,1598587200,'Legacy Early College, SC','Teacher or specialist',5,5,5,5,5,5,'Planning and creating a pacing guide for COVID.','3',3,5,5,5,5,'Having time to plan with my grade level partner.','More breakout.',3,'Presenters did a good job presenting the the material. Most of the information we had already covered in other math PDs. However, I understand how important the content of the workshop is for new teachers. ','',20,22,25,16,NULL,'The modules that were focused on rigor. '),(15292,1598587200,'Legacy Early College, SC','Teacher or specialist',5,5,5,5,5,5,'Sharing anecdotes or news of how other places are preparing helped out. It helped me think of what if situations that otherwise I wouln\'t have done.','3',3,5,5,5,5,'','',3,'','',20,22,25,16,NULL,'Sharing with others.'),(15293,1598587200,'Legacy Early College, SC','Teacher or specialist',5,5,5,5,5,4,'','3',3,5,5,5,5,'I love how everyone shared their views and we got some really great insights','',3,'Teaching lab is great to better prepare us for the classroom.','',20,22,25,16,NULL,''),(15294,1598587200,'Legacy Early College, SC','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,5,5,'','',3,'','',20,22,25,16,NULL,''),(15295,1598587200,'Legacy Early College, SC','Teacher or specialist',5,5,5,5,5,5,'NA','3',3,5,5,5,5,'All\n','NA',3,'Very Helpful','NA',20,22,25,16,NULL,'Breakout Room discussions'),(15296,1598587200,'Legacy Early College, SC','Teacher or specialist',4,4,4,4,4,4,'','3',3,4,4,5,5,'','',3,'','',20,22,25,16,NULL,''),(15297,1598587200,'Legacy Early College, SC','Teacher or specialist',5,5,5,5,5,5,'consider what students need','3',3,5,5,5,5,'','',3,'','',20,22,25,16,NULL,''),(15298,1601006400,'Legacy Early College, SC','Teacher or specialist',3,4,4,4,4,4,'Think of areas where my scholars may have learning gaps and discern ways to provide just-in-time support. ','3',3,5,4,4,5,'Discussion. ','More in depth look at learning gaps. What\'s the purpose of closing all these learnings gaps -  as it relates to different mathematical concepts. Like why are all these different concepts and procedural so needed to be grasped? There have been learning gaps since the dawn of mandatory schooling and none of the money/resources we\'ve thrown at this issue has helped much -  so how can we truly make a difference from a systems perspective? What about the system is flawed or outdated? What about the system is skewed toward whites? Why are black and brown students on a whole scoring lower on national assessments? How do we change that from a national and district level? What districts or states are having tremendous success is closing gaps and why are they successful? \n\nThere are a lot of why questions I have and answering the why questions helps me feel motivated to answer the how questions. I think some of the how questions were answered for me but not many why questions. In a sense -  I feel  this was another superficial course on how to close learning gaps among students but will not actually produce any results because the system at large is flawed at so many levels. Yes -  teachers can make a difference in the learning gaps but nationally we need to do some real evaluation and change.\n\nI feel like this whole training could have been summed up with one sentence: \"Teach your grade level content while creating space/time for just-in-time support for scholars who have learning gaps.\" And then maybe giving a list of what just-in-time support looks like. \n ',3,'Because they \"course\" could have been summed up with an hour or less of information. \"Teach your grade level content while creating space/time for just-in-time support for scholars who have learning gaps.\" And then maybe giving a list of what just-in-time support looks like. Yes, implementing these practices will help close some learning gaps. But there are so many more important topics to be discussing when it comes to learning and learning gaps. Once again many of the why questions connected to learning gaps are not brought up or discussed. It\'s like when Nixon was president he declared a \"war\" on cancer and threw all this money into research efforts to reduce cancer in America but nothing positive came about from his \"war on cancer\". Cancer only got worse and worse in America! Concerning Education, we are having all this discussion on learning gaps and what not but never seeking to understand the root of our issues in education across America. The education tree in America is dead or at best dying and we keep expecting to receive healthy fruit. Cut down the tree and plant a new one! Learn from nations or people groups who are getting great education results. \n\nWe have been talking about learning gaps for decades and nothing has changed! Why? There is something bigger going on behind the scenes that needs to be addressed and changed. ','Go into the history of these learning gaps. How did they come about? Has there been success in closing these gaps every? If so where and how? Why are we so concerned about closing the gaps? Why is knowing all these obligatory math standards so important? Students seem to not care about all the unrelated, unconnected, un-useful math standards, why should I be making sure there aren\'t gaps in their learning?',20,22,25,16,NULL,'The discussions'),(15299,1601006400,'Legacy Early College, SC','Teacher or specialist',5,5,5,5,5,5,'I was able to adjust my curriculum map to accelerate the learning of my students. It also helped me to reflect on my own teaching style and how I need to adjust to better serve my students','3',3,5,5,5,5,'This course enlightened me about learning loss due to Covid and students studying from home and online and informed me how to accelerate students learning in light of that fact,','More classroom examples would have been helpful.',3,'The information is sound and well researched and very well targeted to address what\'s happening in the present learning environment.','It was great building better relationships with my colleagues',20,22,25,16,NULL,'The SAP document and how to prioritize the content.'),(15300,1601006400,'Legacy Early College, SC','Teacher or specialist',4,4,3,3,4,4,'','3',3,4,4,4,4,'','',3,'I think we could have covered the same amount of material in far less time ','',20,22,25,16,NULL,''),(15301,1601006400,'Legacy Early College, SC','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,5,5,'','',3,'','',20,22,25,16,NULL,''),(15302,1608008400,'Mississippi Department of Education, MS','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,5,5,'','',3,'','',37,19,16,16,NULL,''),(15303,1594958400,'Tangipahoa Parish, LA','Teacher or specialist',3,3,3,3,3,3,'','3',3,3,3,0,0,'Breakout sessions day 2','Deeper into content',3,'','',23,1,0,12,NULL,'Annotations of text '),(15304,1595476800,'Lafayette Parish, LA','Teacher or specialist',5,5,5,5,5,2,'We did not address the topic of Covid-19. ','3',3,5,5,5,5,'The communication went very well.  The instructors presented the material and allowed for us to share and ask questions.  If the instructor did not know the answer to a question, they eagerly sought out the answer.','I can\'t think of any improvements needed.',3,'I chose this rating because everything went well.  I feel like I gained knowledge that I can share with my team members at by school.','none',23,2,27,12,NULL,'I like the breakout rooms.  Specifically the ones about looking at the Frost poem over and over because we saw the value in looking at a text several times for different reasons.'),(15305,1595476800,'Lafayette Parish, LA','Teacher or specialist',5,5,5,5,5,3,'Blended or virtual learning strategies were not addressed as much as they could have been.','3',3,5,5,5,5,'Strong facilitation','Taking a minute at the beginning to allow participants to get better oriented to materials (possibly discussing how to navigate the virtual world of this PD--have several tabs -  side-by-side Zoom and packet -  etc.',3,'The facilitators made the material relevant and were a pleasure to work with.','The material from the guidebook is overused. Please consider utilizing other examples! This repetition can get tedious.',23,2,27,12,NULL,'Break-out sessions'),(15306,1595476800,'Lafayette Parish, LA','Teacher or specialist',4,5,4,4,5,4,'n/A','3',3,5,5,4,4,'They knew their content and did a good job presenting.','n/a',3,'It allowed me to see the changes I may have to make reflecting on last year.','n/a',23,2,27,12,NULL,'the break out sessions'),(15307,1595476800,'Lafayette Parish, LA','Teacher or specialist',4,4,4,4,4,4,'Being able to ask district specific questions.','3',3,5,5,5,5,'The teachers! Made a MAJOR difference from the last course I took.','After modeling and practicing the standards -  being able to use that to plan a GB lesson on the spot would have been awesome.',3,'The material was more for novice teachers, but it was helpful to me because of Katie\'s teaching.','No.',23,2,27,12,NULL,'Being able to ask questions and actually get answers.'),(15308,1595476800,'Lafayette Parish, LA','Instructional Leader',5,4,4,5,5,4,'preparation','3',3,5,5,5,5,'small group discussions','all was great',3,'great and knowledgable presenters','',23,2,27,12,NULL,'all'),(15309,1595476800,'Lafayette Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Clarified information I was unable to find on the Louisiana Believes website.','3',3,5,5,5,5,'Flowed well without glitches and delay','Faster internet and a device that did not fizzle out when too many people were on the Zoom....chromebook hell.',3,'Efficient and no nonsense approach to learning about guidebooks. Teacher\'s time is valuable and precious and this method honored that.','Great presentation and the presenter has personality!',23,2,27,12,NULL,'Break out sessions with peer teachers'),(15310,1595476800,'Lafayette Parish, LA','Teacher or specialist',5,5,5,5,5,1,'this course has allowed me to narrow my focus to what is important to my students.','3',3,5,5,5,5,'How