800,'Lafayette Parish, LA','School-based coach',5,4,5,5,3,4,'','3',3,5,5,5,5,'','',3,'','',23,2,27,12,NULL,''),(15320,1595476800,'Lafayette Parish, LA','Teacher or specialist',5,5,5,5,5,4,'I do not think the boot camp helped with COVID return preparations.','3',3,5,5,5,5,'Discussions ','',3,'They allowed all of us to learn together and communicate our needs.','Great Job to the both of you!',23,2,27,12,NULL,''),(15321,1595476800,'Lafayette Parish, LA','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,5,5,'','',3,'','',23,2,27,12,NULL,''),(15322,1595476800,'Lafayette Parish, LA','Teacher or specialist',4,5,5,5,5,3,' I believe this course helped prepare me for teaching the curriculum in a regular classroom setting. I was given excellent tools and resources that I can implement in my classroom to help my students become stronger readers and critical thinkers. However, I do not feel that this course addressed issues that may arise with us going back to school in a COVID-19 environment. I taught 2nd grade before the shut down, and some of my students were so far behind that they couldn\'t even write a complete sentence. (A couple of my students read on a kindergarten level at the end of the year and a couple of them still wrote some letters backwards.) I worry that these students will not be prepared for the rigor of this curriculum. Even though the units will start off less complex and gradually build on themselves and the standards will spiral back, I worry that my incoming 3rd graders may be so far behind. I am grateful for this course, the awesome resources, and excellent insight I was given, but I wish there was a way for me to bridge the gap that my students will likely come to me with. ','3',3,5,5,0,0,'I loved the community atmosphere that all the teachers had with one another. It was great to hear from other teachers and to hear everyone\'s suggestions and insight. As a new teacher, I appreciate getting feedback and learning from experienced teachers. ','My only concern with this training is that there really weren\'t many suggestions given that would help return to school in a COVID-19 environment. It would have been nice to even briefly discuss ways we could still integrate the curriculum if we have to go online. Even if we don\'t switch to full virtual -  students will be doing online work half the week -  so we will need to know how to meet these students\' needs on the days they are not with us face-to-face. ',3,'It was an excellent training, but my only issue was that nothing in the training really addressed  how the curriculum could be taught virtually or ways it could be modified to meet students\' needs during COVID-19.','',23,12,0,12,NULL,'Overall, everything we did helped me learn. Everything was interactive and engaging and it was great that we were given chances to talk in smaller groups. '),(15323,1595476800,'Lafayette Parish, LA','Teacher or specialist',4,5,5,4,4,3,'Having a positive environment among others while participating with each other online.','3',3,5,5,0,0,'The explanation of guidebooks in general went very well in this course','More group talk can always improve experience.',3,'I chose this rating because I feel much more confident diving into guidebooks now that I have a stepping stone from this training session which was overall well explained and well thought out.','no',23,11,0,12,NULL,'Breaking apart into groups helped support learning as well as viewing and completing the homework with the screen cast was extremely helpful.'),(15324,1595476800,'Lafayette Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Offered clear understanding of how Guidebooks are organized and this will make my planning more efficient','3',3,5,5,5,5,'The ease of moving from one segment to the other each day; the use of slides to communicate the topic being discussed','I should have made a hard copy of the note-catcher. Moving from one screen to the other as I worked made me addled. This was my failure to prepare.',3,'Because I felt completely secure in the pace the facilitators set, the materials they provided, AND the facilitators ability to answer questions satisfactorily.','I taught GB last year, but did not have the introductory boot camp until this one. This made all the difference. Oddly though, the content of these sessions made more sense because I did already have experience with GBs.',23,11,18,12,NULL,'Screencast and flow charts in note-catcher'),(15325,1595476800,'Lafayette Parish, LA','Teacher or specialist',5,5,5,5,5,5,'Discussing ways to adapt group and pair activities','3',3,5,5,0,0,'The flow and delivery of the information. Also, the open discussions among participants.','At this time I do not have any suggestions.',3,'It was very helpful. ','N/A',23,12,0,12,NULL,'I enjoyed it all. '),(15326,1595476800,'Lafayette Parish, LA','Teacher or specialist',3,4,2,4,5,2,'I feel like it was too long of a course and did not prepare me for planning this school year. Though very informative and extremely well done, I don\'t feel its length was necessary. ','3',3,5,5,5,5,'Open conversation','Shorter time -  5th grade only -  exact lessons from the curriculum',3,'I feel like its length was unnecessary. I feel like the info presented could have been presented in 1-2 sessions.','The presenters were AMAZING. My response to this course was in no way reflective of their work and/or presentation. ',23,12,33,12,NULL,'na'),(15327,1595476800,'Lafayette Parish, LA','Teacher or specialist',5,5,5,5,5,3,'this helped me prepare to use guidebooks...the virtual experience went smoothly','3',3,5,5,0,0,'very smooth very informative very knowledgeable','great experience',3,'everything went well and the outcome met the goal','thank you',23,12,0,12,NULL,'all'),(15328,1595476800,'Lafayette Parish, LA','Teacher or specialist',2,2,3,4,5,1,'It hasn\'t','3',3,3,4,0,0,'Realizing that reading fluently doesn\'t mean you have comprehension.','The experience was good.',3,'Na','Na',23,12,0,12,NULL,'The Bycatch'),(15