h while.','n/a',3,'It\'s pretty solid','Gretchen did great too!',12,7,0,11,NULL,'Reflecting on student work to look for errors and how that work can help teach other students.'),(15690,1607662800,'Freire Charter Schools, PA/DE','Teacher or specialist',5,5,5,5,5,5,'Commiserating with my peers and leaning on one another for ideas and support. ','3',3,5,5,0,0,'I liked both parts a lot - love using our own class examples. ','I wish the examples provided were 5th or 6th grade examples sometimes. ',3,'','',12,7,0,11,NULL,'all of them'),(15691,1607662800,'Freire Charter Schools, PA/DE','Teacher or specialist',5,5,5,4,5,4,'','3',3,4,5,0,0,'small groups are great','There was not enough time to plan out the re-engagement activity. Needed more time to complete and talk about it with the team.',3,'','',12,7,0,11,NULL,'pre-work, structure of the small groups'),(15692,1607662800,'OTHER','Teacher or specialist',3,4,3,3,4,2,'','3',3,5,4,0,0,'Structured nicely; activity output onto the google slides was effective, made sense','Seeing more exemplars. Feedback from Gretchen/Lindsay about our re-engagement mini-lessons',3,'','',12,7,0,11,NULL,'The beginning part about reengagement. (I do not love problem of practice sessions.)'),(15693,1607662800,'Freire Charter Schools, PA/DE','Teacher or specialist',4,4,4,3,4,4,'','3',3,4,3,0,0,'opportunity to talk with people in different grades','overall it was fine....the re-engagment piece was a little annoying. But the acitivity was worthwhile',3,'None of my other friends are math teachers','',12,7,0,11,NULL,'talking about VL problems with peers and hearing what others have done'),(15694,1607662800,'Freire Charter Schools, PA/DE','Teacher or specialist',5,5,5,5,5,5,'Problem solving with colleagues and getting suggestions of things I\'d never have considered before! So helpful','3',3,5,5,5,5,'All activities that promoted colleague interaction and support of one another','N/A',3,'Always applicable to my teaching','',12,7,7,11,NULL,'The consultancy