d the benefits/issues that arise when trying to implement them in our classes.','For our pre-work -  we also had to watch and analyze a 5 minute video of us teaching. Additionally -  we had to go through our exit tickets/cool downs and look for evidence of understanding/not understanding. We talked about our videos in our meetings -  but the exit ticket data never came up. I wish that we would have used that information since I spent so much time doing it.',3,'','Not now.',9,7,0,11,NULL,'I really enjoyed being able to pick which article I read about HQIM. Since each article was read by at least one member of the group, I feel like I got the main/big ideas of all three articles while only reading one.'),(15700,1603166400,'Freire Charter Schools, PA/DE','School-based coach',4,4,4,4,5,5,'Our conversations centered around student discourse in the virtual classroom have been really helpful as I navigate how to include it in my virtual classroom!','3',3,5,5,0,0,'I love the community of learners that we have created in this group. I also really appreciate how we are solutions oriented and how Lindsay really listens to what we need help/support with.','We always say we will have time to work on or start planning our PLC at the end of the meeting -  but we always seem to be running short on time.',3,'All in all, I feel like this training has made me become a better leader and internalize my curriculum better!','',9,7,0,11,NULL,'I really appreciated the activity where we had to watch our own recording. As I watched, I was able to see opportunities where I could have pushed more discourse or related a topic to our learning goal of the day.'),(15701,1603166400,'Freire Charter Schools, PA/DE','School-based coach',4,5,3,4,5,5,'The writing the learning goals really helped me navigate the remote learning. ','3',3,5,5,0,0,'I think it was nice to meet as a small group and be able to talk with one another about what is going well not only for us but for our teachers as well. ','',3,'I think also incorporating more discussion about supporting our teams.','',9,7,0,11,NULL,'Writing the learning goals and the evidence analysis. '),(15702,1604379600,'Freire Charter Schools, PA/DE','School-based coach',5,4,4,4,4,4,'Just as a space to voice concerns with other teachers','3',3,5,5,0,0,'The help with planning weekly plc\'s','I know that my l=role looks a little different than the high schools -  so I\'m just glad we found a way to differentiate.',3,'I enjoy working with Lindsay.  She wants to help any way she can and is willing to make adjustments based on my knowledge of my staff','nope',9,7,0,11,NULL,'I enjoy watching model teachers, i just wish there were more virtual examples'),(15703,1605762000,'Freire Charter Schools, PA/DE','School-based administrator or supervisor',3,3,3,4,4,2,'','3',3,4,4,0,0,'','',3,'','',39,7,0,11,NULL,''),(15704,1605762000,'Freire Charter Schools, PA/DE','School-based administrator or supervisor',4,5,4,4,5,3,'We talked about connections to hybrid learning but I think this is an area of improvement. Watching classroom videos of an actual class provided a disconnect to what we are facing in virtual. ','3',3,4,4,0,0,'Watching the videos and using the IPG ','Reaching a consensus on the IPG tool- recording notes from this convo. It was hard to make the coaching conversation super relevant because I felt like I was walking away with a different understanding of the video than my peers. I want to be pushed on this. ',3,'','',39,7,0,11,NULL,'Watching the videos and using the IPG '),(15705,1605762000,'Freire Charter Schools, PA/DE','School-based administrator or supervisor',4,5,4,4,4,4,'I just need to talk about it with other professionals','3',3,5,5,4,4,'conversation surrounding best practices and ways to address challenges in the classroom ','',3,'It was great!','I enjoyed it ',39,7,22,11,NULL,'Watching videos and having conversation '),(15706,1605762000,'Freire Charter Schools, PA/DE','Teacher or specialist',4,4,4,4,4,4,'','3',3,5,