from the content leader cohort ','',13,7,0,17,NULL,'I liked watching the video and calibrating the use of the IPG.  It helps to deepen my understanding.'),(15760,1603339200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',4,5,5,5,4,3,'','3',3,4,4,0,0,'The asynchronous work block activity. ','A little more time for the asynchronous work.  I felt very rushed to complete the activity and probably would have done a better job if I had more time. ',3,'This PL would be valuable for admin, specialists, coaches, AND teachers','',13,7,0,17,NULL,'Using the IPG along with the sample lesson video. '),(15761,1603339200,'Delaware Department of Education, DE','Teacher or specialist',4,5,4,4,4,3,'','3',3,5,5,0,0,'Good mix of asynchronous and synchronous time  to process and reflect on Core Actions 1 and 3c along with the IPG.','I honestly needed MORE time to process and reflect on what was presented and discussed.  There was ALOT of information crammed into a short period of time and I don\'t feel that I was able to fully grasp everything.   My brain takes time to process and when I don\'t have that time -  I don\'t feel as though I learn as well.',3,'I think that the conversations that are had focusing on how equitable math learning opportunities can be provided to all learners is powerful and engaging.  The turn around time between meetings is too short and is a challenge to get everything done with meeting with the teacher to plan a lesson, observe the lesson and then reflect on the lesson.','2 weeks until our next coaching session is too short and not enough time to do everything.  ',13,7,0,17,NULL,'I appreciated the group chats of our lesson reflections to share what was focused on during the first coaching cycle.  What conversations were had?  Questions asked?  '),(15762,1603339200,'Delaware Department of Education, DE','School-based coach',5,5,5,5,4,5,'','3',3,5,5,0,0,'Introduction of IPG and providing appropriate time to learn and calibrate the tool','Facilitators planned well',3,'Potential impact on teacher/coach mindset around the mathematics classroom.','Appreciate the motivation and positive push forward.',13,7,0,17,NULL,'Opportunities to discuss new learning with colleagues '),(15763,1603339200,'Delaware Department of Education, DE','School-based coach',4,4,5,5,5,3,'','3',3,4,4,0,0,'Getting to talk with peers was especially valuable.  I appreciated the time to dig into the IPG.','',3,'','I\'m thinking about the role admin/evaluators play in influencing classroom instruction.  What pedagogical content knowledge and discipline content knowledge is necessary to look for opportunities for the CCSS-MP to be in play (versus watching what the teacher is doing).  How can the work of the math content leader sessions support evaluators in becoming skilled enough to do this (looking for CCSS-MP) well?',13,7,0,17,NULL,'Reviewing the IPG, having an opportunity to reflect on my practice.  I appreciated the well-spaced breaks/asynchronous time so I could walk away from the computer I sit in front of all day ... every day ...'),(15764,1603339200,'Delaware Department of Education, DE','School-based coach',5,5,5,5,5,4,'','3',3,5,5,0,0,'Having the time to work through the action planning document.','Nothing; today was really helpful',3,'Great job/activities today.','I appreciate everything that you a doing to help us do our job effectively with teachers.',13,7,0,17,NULL,'Time to read through the IPG and then discuss our Low-Inference Notes from watching the video (how to score the IPG)'),(15765,1603339200,'Delaware Department of Education, DE','School-based coach',3,5,3,4,5,3,'','3',3,4,4,0,0,'Sharing out about our experiences with teachers after our last meeting. Learning about and starting to internalize the IPG','I feel as though when we got to some break out rooms to discuss after asynch time -  some people had been confused by the directions and therefore misunderstood their responsibility for the task so the conversation took a turn. ',3,'I feel like today\'s session for me felt a little rushed. I wish we had more time to digest the IPG. ','',13,7,0,17,NULL,'IPG analysis'),(15766,1603339200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',3,4,3,3,3,2,'','3',3,4,3,0,0,'balance of independent work, whole group and small group breakout rooms.','too many documents needed -  I often felt lost in the mix even with two screens -  and 3 windows open on my desktops.',3,'Some parts still feel disconnected for me and I\'m not sure others work with would see the value right now without feeling overwhelmed.','Content is a bit dry',13,7,0,17,NULL,'small group breakout, specifically the sharing of the IGP Analysis- it helped me deepen my understanding of the IPG and internalize the document more.'),(15767,1603339200,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,0,0,'I enjoyed the Asynchronous time to think and workout rough draft thoughts.','Maybe more time on each item or less content in one day.',3,'Very thorough and relevant to my profession.','N/A',13,7,0,17,NULL,'Practicing with the IPG and wrapping my head around Low inference note taking'),(15768,1603339200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,1,'','3',3,5,5,0,0,'The sense of community and the asynchronous working time to really dig and reflect on our own learning. Provides processing time ','',3,'','',13,7,0,17,NULL,''),(15769,1604984400,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,0,0,'The schedule is a perfect combination of synchronous and asynchronous learning.  I appreciate having time to work with, and discuss, new concepts.','',3,'Today’s session was extremely relevant and inclusive.  I appreciate having access to all the materials.  Everything was well organized and well executed.','Thank you for all your hard work!',4,7,0,17,NULL,'The breakout rooms offer great opportunities to explore ideas and receive feedback.  I am glad we are in small groups and are given a substantial amount of time for our discussions.'),(15770,1604984400,'Delaware Department of Education, DE','School-based coach',5,5,4,4,5,3,'','3',3,4,5,0,0,'The breakout groups went well where we were able to discuss positive effects in the beginning and then sharing our problems of practice in the afternoon and getting feedback from other coaches. ','It would have been helpful to see some examples of \"dilemmas\". I might have been over thinking it -  but it was difficult for me to come up with one that was not about other people changing their practice because as coaches we want our teachers to change in practice to improve student learning. Again -  I might have been overthinking it. ',3,'I think there is always something from one of these sessions that someone could walk away with. ','',4,7,0,17,NULL,'The Consultancy protocol supported my learning because it gave me a few minutes where my \"dilemma\" was the focus and topic of conversation and I could truly walk away with ideas and possible steps to take. '),(15771,1604984400,'Delaware Department of Education, DE','School-based coach',4,4,4,4,4,3,'','3',3,5,4,0,0,'The focus within our breakout rooms.','I need to remember to get up and move during the day -- less than 500 steps today - that leaves a lot walking for the evening.',3,'This training is well organized, informative and highly connected to coaching expectations.','Thank you for helping me see the connections between this and the other DDOE coaching priorities -- It helped me realize it is not just one more thing, but another structure that I could use when working with teachers during a coaching cycle. I appreciated it and it helped alleviate some stress that I was having. I actually screen shot that slide and will be printing it out for a visual for me.',4,7,0,17,NULL,'The combination of both synchronous and asynchronous work.'),(15772,1604984400,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,4,'','3',3,5,5,0,0,'The student work analysis  to show the evidence of understanding and unfinished learning brought out a conversation with my partner about ideas to possibly implement to help with student understanding.','Didn\'t have enough time to fully develop my action plan at the end.  Of course it is always needing more time.',3,'This training involves full commitment and a lot of time and effort as it is year long.','',4,7,0,17,NULL,'The consultancy protocol was useful to get feedback or suggestions on how to approach my dilemma.  Some of the clarifying questions asked made me pause and really think about my dilemma through a different lens.'),(15773,1604984400,'Delaware Department of Education, DE','School-based coach',4,5,5,4,4,3,'','3',3,4,4,0,0,'Thank you for making the adjustments to accessing materials and being clear about the materials','I was wondering whether it might be possible to have viewable links rather than copy links to the documents?  Sometimes I just want to see the document (especially when I go back later) -  and having a link that requires a copy be made means I have 5-6 copies in my drive. :|  I can just delete them -  and I do -  but the viewable link would avoid that.  We would still need to make a copy to write on -  so it wouldn\'t affect that.\n\nAlso -  I wondered whether the required work for the next session might be added to an announcement in the Schoology group -  or to a document in a prominent place in the Schoology group?',3,'','',4,7,0,17,NULL,''),(15774,1604984400,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,4,4,5,5,'','3',3,4,4,0,0,'Coming to the conclusion that student work samples tell the real story about student learning.','More time to share and  breakout in small groups.',3,'This work is so important.  Creating awareness leads to intentionality. ','',4,7,0,17,NULL,'Student work analysis'),(15775,1604984400,'Delaware Department of Education, DE','School-based coach',4,5,4,5,5,4,'','3',3,5,5,0,0,'really diving into evaluating student work to look for evidence of learning','',3,'I think this has been valuable for me as a coach... but I can see the value in this for teachers, admin ... etc. ','',4,7,0,17,NULL,'independent time to do that... and group time to discuss'),(15776,1604984400,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'','3',3,5,5,0,0,'Break out groups.  ','N/A',3,'The presenters were very clear and supportive while learning new content.','N/A',4,7,0,17,NULL,'Analyzing student work.'),(15777,1604984400,'Delaware Department of Education, DE','School-based coach',5,5,5,5,5,5,'','3',3,5,5,0,0,'What was covered was very important to the work I am doing.','Nothing! It was great!',3,'Very happy with today\'s learning','None',4,7,0,17,NULL,'The asynchronous time as well as the problem of practice discussions.'),(15778,1604984400,'Delaware Department of Education, DE','School-based coach',4,5,4,4,5,4,'','3',3,4,5,0,0,'Gained some useful strategies that I can share with my teachers','Breaking into half-day sessions.  More difficult to stay focused and motivated after lunch.',3,'Well planned out and facilitated.  Provided useful strategies','',4,7,0,17,NULL,'The consultancy protocol breakout groups'),(15779,1604984400,'Delaware Department of Education, DE','School-based coach',3,3,2,3,5,3,'','3',3,3,5,0,0,'Collaborating with my peers.','',3,'Unfortunately I feel this is not applicable to what is happening in our schools right now. ','',4,7,0,17,NULL,''),(15780,1604984400,'Delaware Department of Education, DE','School-based coach',5,5,5,5,5,4,'','3',3,5,5,0,0,'The breakout groups for problems of practice','Today didn\'t feel as rushed as previous days.  Thank you