 you!!!',40,7,0,17,NULL,'The calibration and talking about why we picked what we picked.'),(15804,1606885200,'Delaware Department of Education, DE','School-based coach',4,5,4,4,5,3,'','3',3,5,5,0,0,'Analyzing the CVA','more of a connection to remote learning environment',3,'well-planned and relevant','overall it was beneficial',40,7,0,17,NULL,'Modeling how to connect the different strategies being shared'),(15805,1606885200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',4,4,4,4,4,3,'','3',3,4,4,0,0,'The survey with IPG rubric scores- looking for trends and making observations- then calibrating with peers using evidence to drive the conversations','',3,'','',40,7,0,17,NULL,'CVA asynchronous worksheet'),(15806,1606885200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',4,5,5,4,5,3,'','3',3,4,4,0,0,'The clarity of the IPG and the group calibration','Maybe some more use of tech tools like the whiteboard that we experienced a few sessions ago',3,'All learning is focused on improving math instruction','',40,7,0,17,NULL,'the asynch work with digging into a lesson and student work'),(15807,1606885200,'Delaware Department of Education, DE','Teacher or specialist',5,5,4,5,4,3,'','3',3,4,4,0,0,'combination of breakouts and whole group, opportunities to connect with colleagues','BO rooms seem to consistently have the same people in them across MCL sessions.  I wonder if Zoom has an algorithm for randomness based on people\'s names?  I\'d like to get to talk with some different coaching colleagues.',3,'','',40,7,0,17,NULL,'what teachers should know and consider when modeling mathematics with students using tasks.'),(15808,1606885200,'Delaware Department of Education, DE','School-based coach',5,5,5,5,5,4,'','3',3,5,5,0,0,'Really appreciated the work that we did asynchronously today as well as the discussion immediately after to calibrate our scoring.','Nothing',3,'Great Day. ','Would like additional resources on the progression examples in the CVA Progressions Worksheet. Are there any resources out there? Has anyone done this with different common core topics/stands?',40,7,0,17,NULL,'Asynchronous Work and discussion when we came back from lunch to calibrate ur scoring.'),(15809,1606885200,'Delaware Department of Education, DE','Teacher or specialist',5,5,5,5,5,5,'','3',3,5,5,0,0,'I thought it was a great day that ran seamlessly.  The scheduled blocks of time for synchronous and asynchronous time is a perfect balance.  This has become a great community of educators and I learn a great deal from everyone’s contributions.  ','',3,'I have found these sessions extremely beneficial and believe the knowledge I have gained will improve the teaching in my district as well as the students’ learning experiences.','Thank you for all your hard work putting these sessions together!',40,7,0,17,NULL,'The small breakout rooms after the first asynch block was helpful to discuss our individual ratings of the video and digging deeper into the IPG.'),(15810,1606885200,'Delaware Department of Education, DE','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'','3',3,5,5,0,0,'Very informative and helpful to have a change to talk with other teachers/coaches.','Whole days are tough -  but I understand the reason.  ',3,'Very relevant and informative.','I appreciate this time, as it loads my coaching tool box.  At this time it\'s just really hard to engage teachers, but what Nicole, Renee, and Lindsey said; something like, what\'s the small thing we can do to relieve the stress steered also towards pushing teachers to best practice?  This is a good mindset and I thank you for your support!',40,7,0,17,NULL,'Small group discussion time with great prompts.'),(15811,1606885200,'Delaware Department of Education, DE','School-based coach',4,5,4,4,4,3,'','3',3,5,5,0,0,'I found it beneficial to talk in small groups to calibrate our \"scoring\" on the IPG','I would have liked to have had an opportunity to see more than one example of a teacher\'s classroom. For example -  a lesson that \"scores\" pretty high on the IPG v a lesson that wouldn\'t score as high and the evidence used to distinguish between the two \"scores\"',3,'I think the learning went well and it was helpful that we all watched the same teacher when scoring on the IPG for 2a. I would have liked to have had more time in small groups. I feel like the discussions in small group are sometimes more in depth. ','',40,7,0,17,NULL,'The calibration of the IPG after watching the video and sharing our feedback that we would give to the teacher.'),(15812,1606885200,'Delaware Department of Education, DE','DDOE Ed Associate ECR Workgroup',4,4,5,5,5,4,'','3',3,5,5,0,0,'The combination of asynchronous and synchronous learning.  The activities were well-planned. ','',3,'This learning supports my work with SWD.  Insight into how to provide standards based learning for all students.  ','Thank you for allowing me to be an observer.  ',40,7,0,17,NULL,'The observation activity during the asynchronous work. '),(15813,1603166400,'Nebraska Innovation Network Fellowship','District/network-based coach or Curriculum and instruction specialist',5,5,4,5,5,5,'I attended the Launch NE webinars in the summer and read the documents when they came out.  I shared information about what we should focus on, as identified by NDE and the partners in the resources, with my teachers. ','3',3,5,5,5,5,'Good discussions about the power of HQIM and equity.','',3,'All of the information has been very helpful and it has been most helpful to be able to go back and look at things after the sessions have been completed when the information is \"just in time\" for the next steps we are about to take.','Thank you for the energy you bring to the sessions!  ',2,3,4,14,NULL,'breakout room discussions.'),(15814,1603166400,'Nebraska Innovation Network Fellowship','NDE ',4,4,4,4,5,3,'Timing late','3',3,4,4,4,4,'Getting to work with great educators','More voice from participants',3,'Good mix of things',' Keep up the good work',2,3,4,14,NULL,'Liked the format'),(15815,1603166400,'Nebraska Innovation Network Fellowship','School-based administrator or supervisor',4,5,5,5,5,3,'','3',3,5,5,3,3,'Getting back into it...forcing me to jump back on board with the important mission.','Nothing you could do...I need my team to be on board and with me.  I will try for next time.',3,'We have a real need for a new HQIM for ELA','',2,3,4,14,NULL,'Time to talk with ESU 13'),(15816,1603166400,'Nebraska Innovation Network Fellowship','District/network-based coach or Curriculum and instruction specialist',4,4,3,4,4,4,'So far, keeping the focus on equity','3',3,4,4,0,0,'Breakouts were good. ','More time in breakouts',3,'So far what we are doing is a direction we need to go to be equitable across our district','',2,3,0,14,NULL,'Breakouts with visioning'),(15817,1603166400,'Nebraska Innovation Network Fellowship','District/network-based coach or Curriculum and instruction specialist',3,5,2,2,5,2,'I have some resources to look through to determine if we opened the year correctly, but I\'m afraid that we\'re rolling now and can\'t use as many resources since we are already going.','3',3,4,4,0,0,'I enjoyed having some time with those within my district.','I felt that we covered too much material.  Being new -  I had never seen most of these documents and felt a little like drinking from a fire hose.  I know my team members can catch me up. ',3,'I am afraid that I didn\'t gain much from this particular training.  It set me up to ask future questions.','',2,3,0,14,NULL,'I enjoyed the documents that we skimmed. I plan to look at those more deeply in the future.'),(15818,1603166400,'Nebraska Innovation Network Fellowship','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'','3',3,5,5,5,5,'Breakout room District Collaboration','More 