reat!','',3,'This training was well planned and organized.','',41,4,38,14,NULL,'Breakout rooms for collaboration'),(15855,1605762000,'Wisconsin Department of Education, WI','Teacher or specialist',4,4,4,4,4,4,'','3',3,4,4,4,4,'I really enjoyed the experiential component that allowed me to go through the process, and I appreciated having the opportunity to compare my thinking and work with the exemplars.','It was a well organized day with a good balance of learning and work time.',3,'It was well organized and purposeful.','Thank you!',41,4,38,14,NULL,'Experiential Learning and Team Planning for Implementation'),(15856,1605762000,'Wisconsin Department of Education, WI','CESA Consultant',5,5,5,4,4,4,'I will explore Nearpod as a  tool!','3',3,4,4,4,4,'Resources to support districts to investigate HQM','The pace is fast!  I need time to process.',3,'District leaders want a faster process- We don\'t have many districts with a Curriculum leader as a sole responsibility.','Thank you the opportunity.  Great Resources!',41,4,38,14,NULL,'TEAM TIME- and Independent work time to dig deeper into resources'),(15857,1605762000,'Wisconsin Department of Education, WI','District/network/state-level professional or administrator',4,4,4,3,5,3,'I appreciate the response to the feedback we provide. ','3',3,3,4,2,4,'I appreciated breakout rooms and time to work independently','Link the materials needed into Nearpod or a document.',3,'Today provided specific examples of how to incorporate this work. Please continue to provide these examples, it makes it much easier to share with colleagues.','None at this time',41,4,38,14,NULL,'breakout rooms, collaboration boards , and independent work'),(15858,1605762000,'Wisconsin Department of Education, WI','District/network/state-level professional or administrator',5,5,5,5,4,4,'Love the use of Nearpod, has caused me to go out an learn more about it and try it out with others.','3',3,5,5,5,5,'Lots of opportunities to engage in using the actual tools and experience the learning we might want to do with teachers.','At times -  I wasn\'t sure which doc to be in or that I needed to have the Nearpod back up.  Maybe just Dr Walls saying to come back to the slides in Nearpod would be helpful. ',3,'I am learning so much here - great conversations!','',41,4,38,14,NULL,'opportunities to try out using the tools, breakout groups to talk about the learning'),(15859,1605762000,'Wisconsin Department of Education, WI','District/network/state-level professional or administrator',5,4,5,5,5,5,'','3',3,5,5,0,0,'','',3,'','',41,4,0,14,NULL,''),(15860,1605762000,'Wisconsin Department of Education, WI','District/network-based coach or Curriculum and instruction specialist',5,5,5,5,5,5,'Clarity on how to focus instruction on the standards without feeling like content is being shortened or eliminated for the sake of time.','3',3,5,5,5,5,'Loads of new learning and material was presented.  Great care was taken to provide the material in digestible chunks that can be revisited in some way.  \n','I can\'t think of a way right  now.',3,'I will be sharing this with my partners in curriculum coordination and those at our district level who are supporting teachers with their virtual teaching efforts.','Thank you for helping me join the group at this late date.  I felt welcomed by everyone and did not feel behind or like I had missed out on previous sessions.  The discussions complement the efforts and PD we have had so far this year around equity.',41,4,38,14,NULL,'The experiences where I had to be a student.'),(15861,1605762000,'Wisconsin Department of Education, WI','District/network-based coach or Curriculum and instruction specialist',5,5,4,4,5,3,'','3',3,5,5,5,5,'','',3,'','',41,4,36,14,NULL,'Nearpod, collab boards, team time breakouts '),(15862,1605762000,'Wisconsin Department of Education, WI','CESA',4,3,4,4,5,4,'Engagement strategies','3',3,5,5,0,0,'Collaboration as a large group and small group','We have unique roles in our state. Much of this seemed to fit a district lens better.',3,'Application','',41,4,0,14,NULL,'Unit Unpacking'),(15863,1605762000,'Wisconsin Department of Education, WI','consultant',4,4,1,5,5,3,'links being shared in  emails and the chat were helpful. The amount of tabs to navigate was challenging.','3',3,4,5,0,0,'sharing of ideas, collaboration, videos used, some of the tools','I do not enjoy the use of the notebook -  too clumsy -  we usually don\'t understand how to apply it to our work as a CESA.',3,'Although improving, the work leans toward districts and most of us are not district employees. Also, there is too much homework, we do not have time for this work outside of the days devoted to this learning, and do not have control over the timeline a district will cooperate with us to do the work. Finally, I enjoyed the collaboration, speakers, and listening to those who shared their stories.','',41,4,0,14,NULL,'unpacking the ELA units, Ted Talk, time to plan with our team members'),(15864,1605762000,'Wisconsin Department of Education, WI','District/network/state-level professional or administrator',5,5,5,5,5,5,'Provided tools and protocols for me to use with the groups that I serve.','3',3,5,5,5,5,'The pace and scaffolding of the course was appropriate','I would like to have an outside facilitator in our group breakouts to support staying on point with task and to answer clarifying questions about the completion of task.',3,'This learning is timely and relevant to the building the capacity of leaders and teachers to do the work that we MUST do for our children.','No',41,4,38,14,NULL,'Unpacking HQIM'),(15865,1605762000,'Wisconsin Department of Education, WI','District/network-based coach or Curriculum and instruction specialist',4,5,4,4,4,5,'','3',3,5,5,0,0,'Variety of activities; helpful content','',3,'','',41,4,0,14,NULL,'break out rooms; independent reading and sharing of reflections; walking through examples'),(15866,1605762000,'Wisconsin Department of Education, WI','District/network/state-level professional or administrator',4,3,4,4,4,3,'','3',3,5,4,0,0,'','',3,'','',42,4,0,14,NULL,''),(15867,1605762000,'Wisconsin Department of Education, WI','cesa2',3,4,3,3,3,3,'?','3',3,3,4,3,3,'Good tools and articles were shared','Day one the content seemed weak.  More facilitation of the take-aways -  more time to deeply engage was needed.  Day 2 was much better -  but then many tech glitches slowed things down.',3,'Some good things; Not exceptional','',42,4,38,14,NULL,'Focused team time'),(15868,1605762000,'Wisconsin Department of Education, WI','CESA Specialist',5,5,3,4,4,3,'','3',3,5,4,0,0,'Time to plan with my CESA team.','More time to work with my team. ',3,'Very professional, modeling virtual learning tools and practices, high expertise.','',42,4,0,14,NULL,'Check for understandings using the collaboration board.'),(15869,1596081600,'Nebraska Virtual Zearn PLC, NE','Teacher or specialist',4,3,4,4,5,4,'To know to implement more practice on skills when needed to teach my grade level skills.','3',3,4,5,4,5,'easy to follow','',3,'We are using it as a supplemental tool','',26,16,28,18,NULL,'the last 2 days were good for how will implement it'),(15870,1596081600,'Nebraska Virtual Zearn PLC, NE','Teacher or specialist',3,4,4,3,4,3,'The importance of using grade level standards with my second grade students is so very important while applying \"blended\" learning from the missed areas of content.','3',3,2,3,4,4,'The PD on what Zearn is and how it is organized','clear direction from my district',3,'','',26,16,28,18,NULL,'referencing the Zearn website'),(15871,1596081600,'Nebraska Virtual Zearn PLC, NE','Teacher or specialist',5,5,5,5,5,5,'I am now comfortable utilizing a digital platform for math in a time when online platforms are so necessary!','3',3,5,5,5,5,'The facilitators were always prepared and able to answer our questions or point us in the right direction if they didn\'t have the answers.','More participation from my co-teachers (They were not all participants in the program)',3,'I enjoyed the PLC.','',26,16,28,18,NULL,'I loved getting to utilize the breakout rooms to discuss what this will look like in our school and our district\'s curriculum.'),(15872,1596081600,'Nebraska Virtual Zearn PLC, NE','Teacher or specialist',3,3,4,4,4,4,'It help me begin to think about the items that I will teach and the things I will have to leave out or possible reteach.','3',3,5,5,0,0,'','If would have been helpful if we had know more about the district expectations for Zearn are',3,'','',26,28,0,18,NULL,'');
